    currency: "SGD",
    description:
      "Located 57 storeys up from the heart of the Marina Bay area, the Sands SkyPark Observation Deck boasts scenic views of the panoramic vistas of Marina Bay and Singapore’s world-class cityscape. Take in a bird’s-eye view of Gardens by the Bay and the impressive Supertree Grove, or admire the sea view that stretches from Marina South Pier to the Singapore Strait.\n\nFrom above, try your hand at spotting Singapore’s iconic landmarks. Look out for the capsules on the Singapore Flyer and the durian-shaped domes of the Esplanade – or the Merlion statue, another major tourist attraction in Singapore. Be sure to also keep an eye out for the orange-tiled roofs of the shophouses along the Singapore River.\n\nIf you’re a guest of the Hotel, take a luxurious dip in the Infinity Pool – the iconic rooftop Singapore pool, which offers spectacular views of the city at sunset. After, head down to the Event Plaza to catch Spectra, the free outdoor light and water show that takes place nightly on the Waterfront Promenade.\n\nCap off your day at some of the best restaurants and bars in the Marina Bay area. Try the Michelin-starred CUT by Wolfgang Puck, feast on a stacked CrazyShake at Black Tap Craft Burgers and Beer, then stop for a handcrafted cocktail at AVENUE Singapore or LAVO Italian Restaurant & Rooftop Bar.",
