      "Uncover little-visited parts of Singapore on these kayaking adventures catering for all levels of skill or experience - Follow certified instructors along a sea-and-mangrove route - Spot a range of wildlife and enjoy the tranquility of the mangroves - Learn about the heritage of the area and its people, and pick up a thing or two about nature - Choose the easy-to-moderate Mangrove Kayaking that's perfect for beginners and families or the longer, more challenging Ubin Bisect Kayaking for expeditioners wanting a little more adventure",
