    description:
      "AJ Hackett International, the company responsible for the adrenaline rush of more than four million people around the world is in Singapore!\n\nSingapore’s first and only bungy tower stands 50m above the ground on Siloso Beach, Sentosa Island. The site features the Skybridge, a 40m walkway with see-through sections. On it, is the Paulaner Sundowner Deck, which has the best sunset views in Siloso.\n\nThrill-seekers then have the choice of doing the drop and swoop on the Giant Swing, or challenge themselves on the 47m Bungy Jump.\n\nFor those who prefer not to tempt fate, food and beverages are served al fresco, which is open daily, from 10am onwards. Siloso’s new landmark is also the perfect spot to grab a cold one by the beach. Function areas are available for MICE, gatherings, parties, and other special events.",
