    description:
      "Experience stress-free private transfers between Singapore airport and your city hotel with 3, 5 and 9 pax vehicles available - Enjoy comfortable airport-hotel transfers in a modern air conditioned vehicle - Receive a convenient pick up service from the airport arrivals hall or your hotel lobby from your professional driver - Arrive at your destination quickly and safely with your experienced driver - Choose between various vehicle options to suit your traveling party needs",
