      "Dine in the sky at Singapore's Faber Peak — hop into a cable car for an unforgettable experience of delicious food and mesmerizing views of the city! - Feast on a rich 4-course dinner aboard the famous Singapore Cable Car - Dine under the stars in your own private dining room with views to remember - Watch the sunset with that special someone or celebrate an important event with this fantastic dining experience - Catch stunning glimpses of the world below: the iconic Mount Faber Park, Universal Studios, Resorts World Sentosa and more",
