    description:
      "Board the SAEx (Singapore Attractions Express) at various pick up points across the city center and be transported directly to the Singapore Zoo, Night Safari, and River Safari - Fast and friendly service connecting you to top Singapore attractions: Singapore Zoo, Night Safari and River Safari - Enjoy direct bus service with pick ups from most hotels and various locations - Choose from 4 transfer options (1 or 2 way trip, or a full 1 or 2 day pass) - Enjoy [breakfast at Singapore Zoo](https://www.klook.com/activity/140-singapore-zoo-breakfast-singapore/), opt for [tram rides or dinner at the Night Safari](https://www.klook.com/activity/1411-night-safari-package-add-ons-singapore/), or savour on a[ panda pau set at the River Safari](https://www.klook.com/activity/3648-river-safari-panda-pau-set-singapore/)",
    dropoff: false,
    exclusions: [],
