    description:
      "Sit back and enjoy a relaxing boat ride down Singapore River, take in breathtaking views of key landmarks and learn about the city's past - Journey through time as you sail along the routes taken by cargo bumboats - Learn how Singapore grew from a small trading port into a modern metropolis - Marvel at the city's beautiful scenery and skyline as you travel past iconic sights - See Raffles' Landing Site, Fullerton Hotel, Singapore Flyer, Marina Bay Sands and more!",
    dropoff: false,
    exclusions: [],
    fromPrice: "2.81",
    highlights: null,
    hoursOfOperation:
      "**Inclusive Of:** - One roundtrip journey (approx. 40 minutes) - Audio visual commentary on board the boat (English only) **Cruise Route:** - Please see pictorial map of the cruise route and jetty locations [here](http://res.klook.com/image/upload/v1488186895/Brochure_Back_wjl9iq.jpg) - There are altogether 7 jetties along the cruise route - The boarding point is at Fort Canning Jetty - You can disembark at any of the 7 jetties: - Fort Canning Jetty (Clarke Quay) - Eu Tong Sen Jetty (Clarke Quay) - Raffles Place Jetty (Boat Quay) - Raffles Landing Jetty (Boat Quay) - Clifford Pier Jetty (Marina Bay) - Bayfront North Jetty (Marina Bay) - Promenade Jetty (Marina Bay) - Please note that you will not be allowed to re-board the boat once you've disembarked",
