      "<h2>Why You Should Get On Board</h2>\n<p>The FunVee Singapore Hop-on Hop-off bus tour ticket gives you unlimited access to their fleet of open-topped buses for a period of 1 day. With stops at all the major attractions such as Botanic Gardens, Marina Bay Sands, Art Science Museum, Gardens by the Bay, Marina Barrage, Little India, and much more, you can be sure you'll see all of Singapore. Explore these attractions at your own pace, hopping on and off as and when you please. The bus routes also have audioguides onboard, so you can learn more about the attractions that you will spot from the bus.  </p>\n<p>Included with the hop-on-hop-off tickets are entry tickets to Universal Studios™ Singapore, the first and only Universal Studio theme park in Southeast Asia, featuring 24 movies-themed rides and attractions, 8 of which are designed exclusively for Singapore. Universal Studios™ Singapore promises to be a truly unique, world-class movie theme park - designed with careful attention to creating weather-protected experiences that enhance the natural setting of Sentosa Island. Each zone of the park features distinctive architecture, landscaping, and entertainment offerings.  There will be one-of-a-kind rides for you to enjoy, shows that make one laugh, and peaceful gardens to relax in with family and friends, as well as retail and dining establishments.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "73.60",
    highlights:
      "<ul>\n<li>Take advantage of this 24hr hop-on hop-off pass to explore the City of Lions, covering 3 different routes and 40 stops, at a frequency of 1 bus every 15-20min</li>\n<li>You can hop on and hop off the buses as much as you like for a period of 24 hours</li>\n<li>Make a stop at Universal Studios™ Singapore, the unique, world-class movie theme park on Sentosa Island where you can spend a fun day out with your friends and family</li>\n<li>All buses feature audioguides with commentary in English, Chinese, Russian, German, Korean to help you get to know Singapore better</li>\n<li>The bus routes include many iconic attractions, such as Merlion Park, Esplanade Theatre, Chinatown, Botanic Gardens, Marina Bay Sands, Art Science Museum, etc., so you can stop by your favorite spots along the way</li>\n<li>Click <a href=https://cdn-imgix-open.headout.com/Singapore-HOHO/FunVee+Singapre+HOHO+Schedule+.pdf target=”_blank”>here</a> for detailed route and boarding points and <a href=https://cdn-imgix-open.headout.com/Singapore-HOHO/FUNVEE4.pdf target=”_blank”>here</a> for a map</li>\n</ul>",
