    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Why You Should Get On Board</h2>\n<p>The FunVee Singapore Hop-on Hop-off bus tour ticket gives you unlimited access to their fleet of open-topped buses for a period of 1 day. You can use that time to see all of Singapore, with stops at all the major attractions such as Botanic Gardens, Marina Bay Sands, Art Science Museum, Gardens by the Bay, Marina Barrage, Little India, and much more. This gives you the freedom to explore these attractions at your own pace, hopping on and off as and when you please. What’s more, the 3 different bus routes have audioguides onboard, so you can learn more about the attractions that you will spot from the bus.  </p>\n<p>Included with the hop-on-hop-off tickets are entry tickets to Night Safari, the world's first wildlife park built for visits at night. Unlike any ordinary zoo illuminated by the night or a modern version of nocturnal houses found in many zoos around the globe., the Night Safari is nestled in 40 hectares of lush secondary forest and offers guests the unique experience of exploring wildlife in a tropical jungle at night.</p>",
