    id: "HO11268",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<p><strong><em>Please note that this is not a hop-on hop-off tour.</em></strong></p>\n<h3>Schedule</h3>\n<p>The tour begins with pickups at 6 PM and it lasts for 3.5 hours, ending at 9:30 PM</p>\n<h3>Additional Information</h3>\n<p>From 17 Nov. 2018 to 01 Jan. 2019, the stopover at Haji Lane will be replaced by Orchard Road Christmas Light-up Tour</p>\n<h3>Reduced Price Tickets</h3>\n<ul>\n<li>Children aged 3-12 enjoy reduced prices. Please carry a valid photo ID. </li>\n<li>Ages 2yrs and below go free</li>\n</ul>",
    addressLine: "City Tourist Hub @ Marina Square Shopping Mall",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["City Pass", "Local sightseeing"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Why You Should Get On Board</h2>\n<p>Experience the beauty of nighttime Singapore from the comfort of an open-top double-decker FunVee bus. You can visit many of Singapore's iconic attractions, such as the Gardens by the Bay, Merlion Park, the National Gallery, and much more! Watch as the Supertrees come alive at night at the Gardens by the Bay, and make sure not to miss the Garden Rhapsody!</p>\n<p>After your tour through the sights and attractions of Singapore, you will make a stop at Bugis Village, a colorful row of stores, boutiques, bars, cafes and more, where you can pick up keepsakes and other such mementos. Alternatively, you can pick up traditional wares such as Persian carpets, kebaya dresses and handmade perfumes from Arab Street and Bussorah Street. Finally, you will visit Clarke Quay - a riverside festival village dedicated to good times, combining dining and shopping. The quay is situated upstream from the mouth of the Singapore River and Boat Quay. Here, you can hop on to enjoy a River Boat Tour along Singapore River, for amazing aquatic views of the lion city. Perfect for those new to the city, this tour will let you experience Singapore like never before!</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "38.32",
    highlights:
      "<ul>\n<li>Explore Singapore at night on board the FunVee open-top double-decker bus, and see the city dazzle with sparkling lights</li>\n<li>Spot the Gardens by the Bay, the National Gallery, Merlion Park and more from your bus</li>\n<li>Visit the colorful Bugis Village, an array of boutiques, cafes, and hip bars where you can shop for mementos, gifts and the like</li>\n<li>An English-speaking guide will accompany you on the bus, providing live commentary that will familiarize you with the sights and attractions</li>\n<li>Enjoy a riverboat cruise along the Singapore River for an aquatic perspective on the nighttime city</li>\n</ul>",
