    inclusions:
      "<ul>\n<li>Admission voucher to the River Safari.</li>\n<li>Admission voucher to the Night Safari.</li>\n<li>River Safari Cruise.</li>\n<li>Amazon River Quest.</li>\n<li>40-minute Tram Ride at the Night Safari.</li>\n</ul>",
    keywords: ["family friendly", "nightlife", "skip the line"],
    latitude: 1.4029035568237305,
    longitude: 103.79170989990234,
    pickup: false,
    priceApproved: false,
