      "\n<h2>Know Before You Go</h2>\n<h3>COVID-19 Safety Measures</h3>\n<ul>\n<li>All guests must wear a face mask in the gardens</li>\n<li>Social distancing of at least 2 meters between guests must be maintained</li>\n<li>There are sanitation stations accessible</li>\n</ul>\n<h3>Important Information</h3>\n<ul>\n<li>Children aged 11yrs and under may enter free of charge </li>\n<li>This facility is wheelchair accessible</li>\n<li>Nearest car parking is available at the Tyersall Gate Carpark at Tyersall Avenue and Nassim Gate Visitor Centre Carpark at Cluny Road</li>\n</ul>\n<h3>Timings</h3>\n<ul>\n<li>Daily from 8:30 AM- 7:00 PM </li>\n<li>Last admission at 6:00 PM</li>\n</ul>",
