    description:
      "<h2>Your Experience</h2>\n<p>Located within the Singapore Botanic Gardens itself, the National Orchid Gardens is the country’s first-ever UNESCO World Heritage Site, and is, therefore, a world-renowned attraction. Since the year 1859, orchids have been closely associated with botanic gardens. The Gardens’ orchid breeding program deserved a place to showcase the end result, in all their colorful splendor. You could say these orchids were handcrafted by the horticultural staff at the Botanic gardens! This garden boasts over 1,000 species of orchids and 2,000 hybrids of 2 or more orchid species. Walk through the four zones based on seasons, each glamorous with their individual color spectrums.</p>",
