    id: "HO7442",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "<p>Resorts World Sentosa is honored to be awarded the SG Clean quality mark across our resort, including the Casino, hotels, attraction parks, F&amp;B outlets, retail outlets, and convention center. The SG Clean Quality mark further highlights our commitment to safeguard our guests and Team Members’ well-being, by adhering to the National Environment Agency’s new benchmark of sector-specific sanitation and hygiene checklists. For more information, please visit www.sgclean.gov.sg</p>\n<h2>Know Before You Go</h2>\n<p><strong>Important Information</strong></p>\n<p><em>Express Pass</em></p>\n<p>The Express Pass allows you to beat the long queues on select rides at the theme park. You can purchase these tickets at an additional fee on your base ticket cost, at the venue. Your default tickets do not include the Express Pass.</p>\n<h3>Timings</h3>\n<p>Please refer to the Universal Studios Singapore <a href=https://www.rwsentosa.com/en/attractions/universal-studios-singapore/plan-your-visit>webpage</a> for the latest operating hour</p>\n<ul>\n<li>Mar- 30 Apr 2020: 10:00 AM- 5:00 PM</li>\n<li>1, 2, 9, 16, 23, 24 &amp; 30 May 2020: 10:00 AM- 8:00 PM </li>\n<li>1–5, 7-12, 14-19, 21-26 &amp; 28-30 June 2020: 10:00 AM-8:00 PM</li>\n<li>\n<p>6,13,20 &amp; 27 June 2020: 10:00 AM- 9:00 PM</p>\n</li>\n<li>\n<p>Please note that the below USS activities will be suspended from 27 Mar 2020 until further notice, as part of the new COVID-19 measures:</p>\n</li>\n</ul>\n<p><i> USS Indoor Shows: </i> \nWaterWorld, Pantages Hollywood Theater, Light, Camera, Action! Hosted by Steven Spielberg, Donkey LIVE, Shrek 4-D Adventure</p>\n<p><i> USS Outdoor Shows: </i> \nMel’s Show, Rythem Truck, Raptor Show, <em>FFA Dance of the Magic Beans, </em>Madagascar Boogie Show, <em>Velociraptor (</em>converted into Meet &amp; Greet)</p>\n<p><i> USS VIP Experience </i> \n· Sesame Street Character Breakfast</p>\n<ul>\n<li>\n<p>Lake Hollywood Spectacular: No scheduled performances for the month of Mar and Apr 2020</p>\n</li>\n<li>\n<p>Hollywood Dreams Light-Up Parade: No scheduled performances for the month of Mar and Apr 2020</p>\n</li>\n<li>\n<p>Jurassic Park Rapids Adventure is closed for scheduled maintenance from 23 Mar- 9 Apr 2020</p>\n</li>\n<li>\n<p>Lights, Camera, Action! Hosted by Steven Spielberg is closed for scheduled maintenance from 8-21 May 2020</p>\n</li>\n</ul>\n<p><strong>Getting There</strong> </p>\n<p><em>By Train:</em> To get to USS by train take the Sentosa Express to the Waterfront station. </p>\n<p><em>By Car:</em> By car, you can arrive at USS by following the left lane on Sentosa Gateway. </p>\n<p><em>By Cable Car:</em> For a more scenic route, ride the cable car to the Imbiah station before taking the Sentosa Express to Waterfront Station.</p>",
    addressLine: "Universal Studios Singapore",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Theme Parks", "Urban Adventures"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      '<h2>Your Experience</h2>\n<p>Experience Hollywood in Southeast Asia! Enjoy the glamor and glitz of Universal Studios, one of Hollywood’s biggest productions, in the heart of Singapore on Sentosa Island. The park is divided into seven differently themed zones, namely New York, Madagascar, Sci-Fi City, Ancient Egypt, The Lost World, Far Far Away and Hollywood. Each zone holds its own charm and provides entertainment for all. Spend your day traveling across the different zones and trying out the different rides they have to offer. </p>\n<p>Whether you\'re going with friends, family or even alone, Universal Studios has something for everyone! Queue up to experience Transformers: The Ride and experience the thrilling, 2000 ft long ride with multiple light installations and motion platform mounted vehicles to simulate the battle between the Autobots and the Decepticons over the All Spark. Or ride the BattleStar Galactica inverted rollercoasters that will take you to a height of almost 150 ft and plunge you underground as well! Families with young kids can go on equally fun rides like Madagascar: A Crate Adventure, Dino-Soarin’ and Sesame Street Spaghetti Space Chase!</p>\n<p>If shows are more your cup of tea, make sure you catch Lights, Camera, Action, and watch an empty soundstage turn into the scene of a hurricane, and witness movie magic before your very eyes. Step into WaterWorld and watch death-defying stunts at this live water show that will keep you on the edge of your seat. For those desiring something more kid-friendly, head on to Elmo\'s TV Time or Shrek\'s 4D Adventure, perfect for a family adventure!</p>\n<p>To plan your day better and to know more about the theme park, read our detailed guide on <a href="https://www.headout.com/category/517/universal-studios-singapore" target="_blank">Universal Studios Singapore.</a></p>',
    dropoff: false,
    exclusions: "",
    fromPrice: "61.60",
    highlights:
      "<ul>\n<li>Unlimited access to rides, attractions, and shows at the venue across all 7 zones</li>\n<li>Tickets for Universal Studios Singapore are valid for the entire day</li>\n<li>Enjoy iconic rides such as the Transformers Ride, and Battlestar Galactica: Human vs Cylon</li>\n<li>Live out your silver screen dreams, go on hair-raising rides, and enjoy lifelike shows beyond all imaginations</li>\n</ul>",
