    id: "HO7443",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<p><strong>Important Information</strong></p>\n<ul>\n<li>Please note that entry to Typhoon Theatre is not included. Tickets to Typhoon Theatre can only be purchased directly from the venue.</li>\n<li>Should you want to purchase tickets to The Maritime Experiential Museum as well, please choose the correct variant during the next stage of booking which includes access to both S.E.A Aquarium and the Maritime Experiential Museum.</li>\n</ul>\n<p><strong>Timings</strong></p>\n<p>S.E.A Aquarium is open daily from 10:00 AM - 5:00 PM.</p>\n<p><strong>Accessibility</strong></p>\n<p>Guests travelling in wheelchairs can access most of the routes in S.E.A. Aquarium. Ocean Dome can be accessed by the lift located along the back of the Ocean Gallery.</p>\n<p><strong>Getting There</strong> </p>\n<p>To get to S.E.A Aquarium by train take the Sentosa Express from level 3 of Vivo City. To get here by the public bus system take route RWS8.</p>",
    addressLine: "S.E.A. Aquarium",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Nature and Wildlife", "Zoo & Aquarium"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>What to Expect</h2>\n<p>The S.E.A. Aquarium is one of the most popular attractions in Singapore and a must for visitors to the city. Here, you can explore the marine realm of S.E.A. Aquarium at Resorts World Sentosa. The Aquarium is home to diverse species of marine animals across different habitats and guests will be awed by the fascinating marine life under the sea.</p>\n<p>Once you skip the line and enter the Aquarium, you will feel as though you're walking right through the oceans of the world as you gaze at more than 100,000 marine animals of over 800 species. The S.E.A. Aquarium journey will take you through 49 habitats in the 10 zones, which features the Open Ocean, Red Sea, East Africa, and the South China Sea, to name a few, all of them are home to exotic species that are taken care of exquisitely in these replicas of their natural habitats. Furthermore, just to top off your S.E.A Aquarium experience, you can head to the Ocean Restaurant by Cat Cora for a fine-dining experience or S.E.A.Side Snacks if you need a quick bite. Whatever you do, though, ensure that you get to spend plenty of time at the aquarium's centerpiece display, the Open Ocean Habitat, featuring a viewing panel measuring 36 meters in width and 8.3 meters in height – a spectacular window into a serene blue world teeming with marine animals including manta rays and giant groupers as well as schools of fish, truly replicating what the deep ocean looks like. In fact, since the Open Ocean Habitat is a registered diving site, you'll even be able to see divers swimming around and interacting with the marine life. What better way to spend a relaxing day?</p>\n<p>You also have the option of visiting the Maritime Experiential Museum. The Maritime Experiential Museum is an immersive way to learn about the Maritime Silk Routes of days gone by, as well as the journeys of famous mariners in a way where you yourself become the explorer. With a single coherent narrative across 15 thematic galleries which include state of the art multimedia presentations and hands-on exhibits, the museum makes for an epic sea faring voyage through space and time.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "29.60",
    highlights:
      "<ul>\n<li>Visit the famed South East Asia (S.E.A) Aquarium and witness aquatic life at its finest.</li>\n<li>With Skip-the-Line access, worry not about winding queues as you would receive direct access to the aquarium's famed zones.</li>\n<li>With over 100,000 marine animals of over 800 species, spread across 10 zones and 49 habitats, you will get to embark on an aquatic expedition like never before!</li>\n</ul>",
    hoursOfOperation: "",
