          "<p><strong>How To Use Your Tickets</strong></p>\n\n<p>You will receive an email with your S.E.A Aquarium mobile voucher. No need to print. You can show the voucher on your mobile device at the ticketing counter along with a valid photo ID for identification.\n<br>\n<br>\nProceed to Adventure Cove Waterpark Guest Services Window or the nearest self-help kiosk at S.E.A. Aquarium between 10 AM to 5 PM to redeem your voucher for admission tickets. \n</p>",
