    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<h3>Schedule</h3>\n<p>Click <a href=https://cdn-imgix-open.headout.com/Singapore-HOHO/Big+Bus+Singapore+HOHO.pdf target=”_blank”>here</a> for detailed route and boarding points. You can join the tour from any of the 60 stops.</p>\n<p><strong>Yellow Route</strong>:</p>\n<ul>\n<li>Popular stops on the route are Clarke Quay, Singapore Art Museum, Botanic Gardens &amp; more.</li>\n<li>Frequency: Approx. every 15-25 min</li>\n<li>First bus at 9 AM from Suntec City Tourist Hub and last bus is at 6:00 PM</li>\n</ul>\n<p><strong>Red Route</strong>:</p>\n<ul>\n<li>Popular stops on the route are the City Hall, Little India, Chinatown and more.</li>\n<li>Frequency: Approx. every 20-25 min</li>\n<li>First bus at 9:30 AM from Suntec City Tourist Hub and last bus is at 5 PM</li>\n</ul>\n<p><strong>Blue Route</strong>:</p>\n<ul>\n<li>Popular stops on the route are Mandarin Orchard and the Indian Heritage Centre</li>\n<li>Frequency: Approx. every 30 mins</li>\n<li>First bus at 9:25 AM from Suntec City Tourist Hub and last bus is at 5:15 PM</li>\n</ul>\n<p><strong>Green Route</strong>:</p>\n<ul>\n<li>Popular stops on the route are Gardens by the Bay, Marina Bay &amp; more.</li>\n<li>Frequency: Approx. every 40 min</li>\n<li>First bus at 10 AM from Suntec City Tourist Hub and last bus is at 6:30 PM</li>\n</ul>\n<h3>Walking Tours</h3>\n<p><strong>Chinatown Walking Tour</strong></p>\n<ul>\n<li>Meet Up Time: 10:30 AM (Mon, Wed, Fri, and Sund)</li>\n<li>Meeting Point: Pagoda Street, Tourist Information Kiosk (next to Sri Mariamman Temple)</li>\n</ul>\n<p><strong>Little India Walking Tour</strong></p>\n<ul>\n<li>Meet Up Time: 10:30 AM (Tue, Thu, and Sat)</li>\n<li>Meeting Point: 5 Campbell Lane, Outside Indian Heritage Centre</li>\n</ul>\n<h3>Night City Tours</h3>\n<ul>\n<li>Check In Time: 6:00 PM, daily</li>\n<li>Tour Time: 6:30 PM, daily</li>\n<li>Meeting Point: BIG BUS &amp; DUCK Tourist Hub, 3 Temasek Boulevard, Suntec City #01-330 Singapore 038983</li>\n</ul>",
    addressLine: "Singapore",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Bus Ticket", "City Pass"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Why You Should Get On Board</h2>\n<p>While it is difficult to discover all of Singapore’s wonderful landmarks in a few days, this hop-on hop-off ticket gets you as close as possible to achieving this feat. You have 3 different routes and 3 attraction shuttles to choose from, each with its own unique sights, and more than 40 stops that you can potentially visit. </p>\n<p>You can begin your tour from any of the 40 different stops. A suggested itinerary is as follows: You could begin your tour by visiting the Botanic Gardens, which opens early at 9.50 AM. Following the yellow line will take you through the many iconic hotels such as Rendezvous Hotel, Marriott Hotel, and Orchard Hotel. You can also visit the Singapore Art Museum and the City Hall. Switch to the Blue Line at the National Museum and cruise through Arab Street and Jalan Besar. Check out Little India and Kampong Glam on the Red Line before ending your day with a trip to the bay area. Here, you will experience the wonders of Sentosa Island and the Gardens by the Bay. If you have time to spare, you could even get a pass to the Universal Studios theme park on Sentosa Island.</p>\n<p>The hop-on-hop-off bus tour offers you the most comprehensive and thorough touring system in Singapore, but it can also double as a great way to get around the city, especially if you are new to Singapore.  If you so choose, you could also go on an optional night tour of Singapore's most vibrant night attractions, where you can learn more about Singapore and try delicious delicacies on the streets!</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "37.60",
    highlights:
      "<ul>\n<li>This highly flexible Hop-on, Hop-off tour ticket allows you to discover Singapore in 1 or 2 days</li>\n<li>You can explore the city of Singapore by using 3 different routes and 3 attraction shuttles, with more than 40 conveniently situated stops</li>\n<li>All the buses are specially designed to provide you with amazing views of Singapore from the inside</li>\n<li>Enjoy the tour with pre-recorded commentary that is available in 12 different languages including English, Spanish, French, Japanese, Korean, Japanese, Chinese, Russian, Italian, German, Vietnamese, Bahasa Indonesia</li>\n<li>The 2-day hop-on hop-off ticket includes two walking tours and an optional night tour</li>\n<li>Click <a href=https://cdn-imgix-open.headout.com/Singapore-HOHO/Big+Bus+Singapore+HOHO.pdf target=”_blank”>here</a> for detailed route and boarding points</li>\n</ul>",
