    id: "HO10018",
    type: "attractionsList",
    active: false,
    additionalInfo:
      '\n<h2>Know Before You Go</h2>\n<h3>Important Information</h3>\n<ul>\n<li>Singapore Flyer is open for visitors from 23 July 2020</li>\n<li>Singapore Flight (basic) tickets will only be available for purchase and redemption at Travel Trade Concierge from Thursday, 6 August 2020</li>\n<li>Please arrive at the Guest Service Lounge on Level 1 of the Singapore Flyer at least 30 minutes in advance of the flight time</li>\n<li>Children under the age of 7 are not permitted for the Sky Dining</li>\n</ul>\n<h3>Menu</h3>\n<p>You can choose from the following menus</p>\n<ul>\n<li>Western Menu ( Main Courses Selections - Fish or Lamb )</li>\n<li>Oriental Menu ( Main Courses Selections - Chicken )</li>\n<li>Vegetarian Menu ( Main Courses Selections - Chinese Zucchini and\nChestnuts )</li>\n</ul>\n<p>For more details about the menu,  please refer to this <a href="https://headout-open.s3.amazonaws.com/Additional+Info/Singapore-Flyer-Sky-Dining-Menu_Jul-Dec-20191.pdf">document.</a></p>\n<h3>Timings (Updated 2020)</h3>\n<p>Thu - Sun and public holidays: 3 PM – 9 PM (last admission at 8.30 PM)</p>\n<p><strong>Guest Services Lounge</strong></p>\n<p>Thu - Sun and public holidays: 2.30 PM – 9 PM</p>\n<p><strong>Travel Trade Concierge</strong> </p>\n<p>Thu - Sun and public holidays: 2.45 PM – 8.15 PM</p>',
    addressLine: "Guest Service Lounge Level 1 Singapore Flyer",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Local sightseeing", "Panoramic views"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<h3>See Singapore From the Sky</h3>\n<p>The Singapore Flyer is the world’s second largest observation wheel and reaches a maximum height of 165 meters from the ground. The capsule is lavishly designed, giving you the best views of the city as the observation wheel move around. Full-length glass panels are present all around, giving you unhindered views of Singapore. The capsules are all air-conditioned, and your comfort is of utmost priority. You can see up to 28 miles in the distance, including some of the neighboring islands of Malaysia and Indonesia. You will be able to catch sight of the state-of-the-art sporting facility, the Singapore National Stadium along with its massive free-spanning dome. </p>\n<h3>Delight in a scrumptious 4-course Dinner</h3>\n<p>While you move along on the Singapore Flyer, you can enjoy a fine dinner service along with an in-flight host. The feeling of relishing some of the finest cuisines in all of Singapore as you soar into the sky is unmatched and is something that you cannot forget. Dessert, Coffee and Tea are included in the dinner, ensuring that you have a full-fledged Singapore Flyer experience. </p>\n<h3>Explore Singapore with FLYER 360+</h3>\n<p>An interactive exhibit, called FLYER 360+ will give you a visual tour of Singapore’s most famous landmarks. At the touch of your fingertips, you will be able to unveil the history and the various stories associated with each of these attractions. In addition to the 360-degree views of Singapore, you will also be able to discover the intricate details of Singapore and its architectural wonders.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "140.77",
    highlights:
      '<ul>\n<li>Savor a 4-course dinner aboard the Singapore Flyer capsule, as you see the incredible city from the sky!</li>\n<li>With an in-flight host, you are guaranteed a memorable dinner service from the world\'s 2nd largest observation wheel.</li>\n<li>The 1-hour long ride will include 2 rotations on the wheel, giving you ample photo opportunities and chances to catch sight of your favorite landmarks.</li>\n<li>Catch sight of the iconic Singapore landmarks such as the Marina Bay Sands, the Raffles Palace, the Empress Palace and Merlion Park.</li>\n<li>Seated up to 165 meters above ground, you can see stunning panoramic views of Singapore and even parts of Malaysia, over the Strait of Johor. </li>\n<li>Revel in a unique experience, as you witness the magnificent city-state lit up after dark!</li>\n<li>Choose between Western, Oriental and Vegetarian <a target="_blank" href="https://headout-open.s3.amazonaws.com/Additional+Info/Singapore-Flyer-Sky-Dining-Menu_Jul-Dec-20191.pdf">menus</a></li>\n</ul>',
