    id: "HO7715",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<h3>Important Information</h3>\n<ul>\n<li>Singapore Cable Car (Mount Faber Line &amp; Sentosa Line) has resumed its service from 3 July, 2020</li>\n<li>Operating hours: 8.45 am to 8.30 pm (last boarding at 8 pm)</li>\n<li>As a safety measure, the cabin can only accommodate a maximum of 5 guests traveling together in a group</li>\n<li><strong>Child Ticket:</strong> Ages 4-12</li>\n<li>Spuds and Apron is located at the Faber Peak, Mt. Faber</li>\n<li>Good Old Days is located at the Beach Plaza, Sentosa</li>\n<li>Tickets must be redeemed for the activities</li>\n<li>For your safety and in compliance with the guidelines set out by BCA (Building &amp; Construction Authority), helium balloons and any flammable items are strictly not allowed inside the cable car</li>\n<li>Cable Car Skypass tickets can be redeemed at Cable Car Station @ Mount Faber Peak Ticketing Counter <strong>or</strong> Harbourfront Station Ticketing Counter <strong>or</strong> Merlion Station Ticketing Counter</li>\n<li>Wings of Time Tickets need to be redeemed at FUN Shop at Beach Plaza between 5:00 pm and 8:30 pm</li>\n</ul>",
    addressLine: "Mount Faber Peak Ticketing Counter",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Buffet Vouchers", "Outdoor Adventures"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Combo Experience</h2>\n<h3>Cable Car Skypass Experience</h3>\n<p>Don’t miss the ultimate sightseeing experience! Take to the skies to enjoy unparalleled views of Singapore in all its glory. This pass includes both Mount Faber Line and Sentosa Line. Cross through a skyscraper and go across the harbor to reach Mount Faber. On the Sentosa Line, fly over the jungle, sand, and sea and see the many attractions from a unique vantage point.</p>\n<p><strong>Timings:</strong> 9:00 am - 9:30 pm</p>\n<h3>Wings of Time Experience</h3>\n<p>Mesmerizing and captivating, Wings of Time is an award-winning outdoor night show that is a multi-sensory extravaganza, projected onto a larger-than-life water screen.  Sit back and get lost in this magical world as you journey across the fabric of time. Set across the majestic sea, spanning several exotic vistas, and created by a critically acclaimed team of local and international entertainment experts the show is bound to leave you spellbound.</p>\n<p><strong>Timings:</strong> 8:40 pm</p>\n<h3>Buffet Meal Experience</h3>\n<p>Indulge in an exotic buffet over lunch or dinner. Focussing on regional delicacies, you’re guaranteed to have a unique culinary adventure. From rich broths to dried shrimp, your stomach will enter a world of new flavors and taste as you dig into the buffet.</p>\n<ul>\n<li><strong>Lunch Buffet Location and Timings:</strong> Spuds and Apron, 12:00 pm - 2:00 pm</li>\n<li><strong>Dinner Buffet Location and Timings:</strong> Good Old Days, 5:00 pm - 8:30 pm</li>\n</ul>",
    dropoff: false,
    exclusions: "",
    fromPrice: "48.00",
    highlights:
      "<ul>\n<li>Ride the Cable Car to the top and see Singapore from a bird’s eye perspective.</li>\n<li>Relish a delicious buffet, choice of either lunch and dinner.</li>\n<li>Enjoy the Award winning show - Wings of Time - with a backdrop of the sea.</li>\n</ul>",
