    id: "HO10021",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<p><strong>Important Information</strong></p>\n<ul>\n<li>Please arrive at the Guest Service Lounge on Level 1 of the Singapore Flyer at least 30 minutes in advance of the flight time.</li>\n<li>The Singapore Sling Flight is applicable to guests who are 18 or older.</li>\n<li>Guests between the ages of 3 and 17 will be served mocktails.</li>\n</ul>\n<p><strong>Timings</strong></p>\n<p>The Singapore Sling Flight departs everyday at 2:30 PM, 4:30 PM and 6:30 PM and will take approximately 30 minutes to complete.</p>\n<p>Please book the Captain Explorer DUKW Adventure tour at least 24 hours in advance at the Tourist Hub in the Singapore Flyer.</p>",
    addressLine: "Guest Service Lounge Level 1 Singapore Flyer",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["City Pass", "Local sightseeing"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<h3>Relish the World-Famous Singapore Sling</h3>\n<p>Developed in 1915, by a bartender working at the Raffles Hotel, the gin-based cocktail has become a favorite across the world. The best recipes, however, continue to be available only in Singapore. You can enjoy a chilled hand-shaken Singapore Sling served as you are seated on board the Singapore Flyer. As the capsule goes into the sky, you will be able to see far and wide, including certain islands of Malaysia and Indonesia. </p>\n<h3>Tour Singapore on both Water and Land!</h3>\n<p>You will also get the chance to board a restored Vietnam War vehicle that is amphibious. A guide will be accompanying you throughout the trip, giving you information about each of the landmarks and attractions that you pass by. You will begin by exploring the city from its streets. The stunning Esplanade Theatre, the imposing Supreme Court, the City Hall, and Padang are some of the well-known attractions that you can see. When you feel you have seen everything, a cruise through the Marina Bay awaits you! From the calm waters of the bay, unobstructed views of the Merlion Park, the Marina Bay Sands, and various other landmarks are visible. As you sail along the bay, you will understand why the Singapore skyline is widely admired. </p>\n<h3>A spectacular confluence of views from the water, land and the sky!</h3>\n<p>You will have had an unforgettable experience in Singapore, witnessing it from 3 different perspectives. Get ready to have your breath taken from you as you get a comprehensive tour of the Lion City.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "55.20",
    highlights:
      "<ul>\n<li>Savor the Singapore Sling, a cocktail created at the iconic Raffles Hotel in Singapore, and perhaps the best-known drink from the city-state.</li>\n<li>A breathtaking experience awaits you, as you sip on the Singapore Sling while catching clear panoramic views of the renowned Singapore skyline.</li>\n<li>Experience the city from all the perspectives, as you take the Captain Explorer DUKW Adventure that will take you through the streets of Singapore and the Marina Bay.</li>\n</ul>",
