    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<h3>Schedule</h3>\n<ul>\n<li>Click <a href=https://cdn-imgix-open.headout.com/Singapore-HOHO/FunVee+Singapre+HOHO+Schedule+.pdf target=”_blank”>here</a> for detailed route and boarding points and <a href=https://cdn-imgix-open.headout.com/Singapore-HOHO/FUNVEE4.pdf target=”_blank”>here</a> for a map. You can join the tour from any of the 40 stops.</li>\n</ul>\n<p><strong>Green Route</strong> (<em>City Hopper</em>):</p>\n<ul>\n<li>Popular stops on the route are Clarke Quay, Chinatown, Botanic Gardens &amp; more.</li>\n<li>Frequency: Approx. every 15-20 min</li>\n<li>First bus at 9 AM from Singapore Flyer and last bus is at 5:00 PM</li>\n</ul>\n<p><strong>Orange Route</strong> (<em>Marina Bay Hopper</em>):</p>\n<ul>\n<li>Popular stops on the route are the Marina Barrage, Little India, Gardens by the Bay and more.</li>\n<li>Frequency: Approx. every 60 min</li>\n<li>First bus at 10:45 AM from Marina Square Bus Stop and last bus is at 4:45 PM</li>\n</ul>\n<p><strong>Red Route</strong> (<em>Sentosa Shuttle</em>):</p>\n<ul>\n<li>Popular stops on the route are Madame Tussauds and Kings Cross</li>\n<li>Frequency: 4 times daily (09:45 AM, 11:45 AM, 3:45 PM &amp; 5:45 PM)</li>\n<li>First bus at 9:45 AM from Marina Square and last bus is at 5:45 PM</li>\n</ul>",
