    currency: "SGD",
    description:
      "<h2>Why You Should Get On Board</h2>\n<p>The FunVee Singapore Hop-on Hop-off bus tour ticket gives you unlimited access to their fleet of open-topped buses for a period of 1 day. You can use that time to see all of Singapore, with stops at all the major attractions such as Botanic Gardens, Marina Bay Sands, Art Science Museum, Gardens by the Bay, Marina Barrage, Little India, and much more. This gives you the freedom to explore these attractions at your own pace, hopping on and off as and when you please. What’s more, the 3 different bus routes have audioguides onboard, so you can learn more about the attractions that you will spot from the bus.  </p>\n<p>Optionally, you can also go on the HOHO duck tour and night tour, for different perspectives on the city of Singapore. The duck tour will take you through the waters of the Singapore river in a WW2-era amphibious vehicle that can traverse on both land and water. On this tour, you can spot the many attractions of Singapore from the water, and enjoy a relaxed jaunt through the waterways of the city. The night tour, on the other hand, takes you through the many nightlife attractions that line the streets of Singapore for a wonderful night out on the town. Experience Singapore in its entirety with these exciting tours!</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "40.00",
    highlights:
      "<ul>\n<li>Familiarize yourself with the sights of Singapore with these hop-on hop-off bus tickets, covering 3 different routes and 40 stops, at a frequency of 1 bus every 15-20min</li>\n<li>You can hop on and hop off the buses as much as you like for a period of 1 day</li>\n<li>All buses feature audioguides with commentary in 5 languages that'll help you get to know the city of Singapore better</li>\n<li>The bus routes include many iconic attractions, such as Merlion Park, Esplanade Theatre, Chinatown, Botanic Gardens, Marina Bay Sands, Art Science Museum, etc., so you can stop by your favorite spots along the way</li>\n<li>You can also go on an optional night tour or a duck tour of the city along with the hop-on-hop-off tour, for different and unique perspectives on the city</li>\n<li>Click <a href=https://cdn-imgix-open.headout.com/Singapore-HOHO/FunVee+Singapre+HOHO+Schedule+.pdf target=”_blank”>here</a> for detailed route and boarding points and <a href=https://cdn-imgix-open.headout.com/Singapore-HOHO/FUNVEE4.pdf target=”_blank”>here</a> for a map.</li>\n</ul>",
