      "\n<h2>Collection Point</h2>\n<p>This 4G SIM Card is available in the following areas of the Changi Airport for redemption:</p>\n<h3>Airport Pick-up Locations</h3>\n<p>Terminal 1, 2, 3 and 4, at the UOB currency exchange counters.</p>\n<p><strong>Confirmation Voucher</strong></p>\n<p>You will receive an email confirmation with your mobile voucher shortly. You may display it at the collection point along with a valid photo ID. Your voucher is valid for a month from the date of selection.</p>",
