    description:
      "<h2>Product Details</h2>\n<p>Pick up a 4G SIM Card upon arrival at the Changi Airport or after reaching the Singapore city center. This 4G SIM Card enables you to stay connected with your friends as you explore Singapore. </p>\n<p><strong>Additional Information</strong></p>\n<ul>\n<li>This top-up is not available with Tourist SIM Card.</li>\n<li>Please do not have more three SIM Cards under your name, over a period of six months.</li>\n<li>Activate your SIM Card after redeeming them from the collection point. </li>\n<li>In case you want to get multiple SIM Cards and want to activate them on separate dates then please make sure to book them and redeem them separately.</li>\n</ul>\n<h2>Data</h2>\n<p>This SIM Card is available with 1.2 GB of data.</p>\n<h2>Talktime</h2>\n<p>This SIM Card is available with two international talk time variants:\n- 20 minutes\n- 50 minutes</p>",
