    id: "HO8003",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<p>Please note that you both your Universal Studios tickets and your Sentosa Fun Pass are valid for 60 days and can be used on any day within that time frame. You can visit Universal Studios and Sentosa Island on different days. However, regardless of how many attractions your Sentosa Fun pass is for, all the attractions included must be done on the same day.</p>\n<h3>Timings</h3>\n<ul>\n<li>Mar- 30 Apr 2020: 10:00 AM- 5:00 PM</li>\n<li>1, 2, 9, 16, 23, 24 &amp; 30 May 2020: 10:00 AM- 8:00 PM </li>\n<li>1–5, 7-12, 14-19, 21-26 &amp; 28-30 June 2020: 10:00 AM-8:00 PM</li>\n<li>\n<p>6,13,20 &amp; 27 June 2020: 10:00 AM- 9:00 PM</p>\n</li>\n<li>\n<p>Please note that the below USS activities will be suspended from 27 Mar 2020 until further notice, as part of the new COVID-19 measures:</p>\n</li>\n</ul>\n<p><i> USS Indoor Shows: </i> \nWaterWorld, Pantages Hollywood Theater, Light, Camera, Action! Hosted by Steven Spielberg, Donkey LIVE, Shrek 4-D Adventure</p>\n<p><i> USS Outdoor Shows: </i> \nMel’s Show, Rythem Truck, Raptor Show, <em>FFA Dance of the Magic Beans, </em>Madagascar Boogie Show, <em>Velociraptor (</em>converted into Meet &amp; Greet)</p>\n<p><i> USS VIP Experience </i> \n· Sesame Street Character Breakfast</p>\n<ul>\n<li>\n<p>Lake Hollywood Spectacular: No scheduled performances for the month of Mar and Apr 2020</p>\n</li>\n<li>\n<p>Hollywood Dreams Light-Up Parade: No scheduled performances for the month of Mar and Apr 2020</p>\n</li>\n<li>\n<p>Jurassic Park Rapids Adventure is closed for scheduled maintenance from 23 Mar- 9 Apr 2020</p>\n</li>\n<li>\n<p>Lights, Camera, Action! Hosted by Steven Spielberg is closed for scheduled maintenance from 8-21 May 2020\n<strong>Sentosa Island Timings</strong></p>\n</li>\n</ul>\n<p>Sentosa Island is open daily from 10:00 am - 07:00 pm.</p>\n<p><strong>Universal Studios Express Pass:</strong></p>\n<p>The Express Pass allows you to beat the long queues on select rides at the theme park. You can purchase these tickets at an additional fee on your base ticket cost, at the venue. Your default tickets do not include the Express Pass. </p>\n<p><strong>Getting There:</strong> </p>\n<p>To get to USS by train take the Sentosa Express to the Waterfront station. By car, you can arrive at USS by following the left lane on Sentosa Gateway. For a more scenic route, ride the cable car to the Imbiah station before taking the Sentosa Express till Waterfront Station.</p>",
    addressLine: "Sentosa Gateway, Singapore",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Theme Parks", "Urban Adventures"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Why You Shouldn't Miss This</h2>\n<p>An enticing offer like no other, explore two famous Singapore attractions in one go for an experience of a lifetime! While Universal Studios gives you the red carpet, Hollywood treatment you always deserved, Sentosa Island is the place for adventurous rides and roller coasters that'll have your adrenaline pumping and leave you wanting more. \n<br>\nExplore Universal Studios' seven zones that all have different themes - Madagascar, Ancient Egypt, New York, Sci-Fi City, The Lost World, Hollywood and Far Far Away. Don't miss out on Transformers: The Ride, where you can watch the Decepticons and Autobots battle it out in an impressive 2000 ft-long ride with multiple light installations! Thrill-seekers can make their way to the Battlestar Galactica ride which plunges you underground from a height of 150 ft. For families with young children, we recommend rides like the Sesame Street Spaghetti Space Chase or Madagascar: A Crate Adventure. \n<br>\nSentosa Island houses some of Singapore's quintessential landmarks like the 4D Adventureland, Madame Tussauds and the S.E.A. Aquarium. Those with an adventurous bent of mind will have ample options to choose and indulge in. And the best part is, your family's included too, with special experiences curated for the little ones.\n<br>\n<br></p>\n<h2>What to Expect from Your Fun Pass Combo Experience</h2>\n<p>Your Universal Studios and Sentosa Fun Pass Combo gives you access to a day's worth of experiences of two iconic landmarks in Singapore.</p>\n<h3>Sentosa Experience</h3>\n<p>Your Sentosa Token Fun pass allows you access to the entire island with upto 40% savings - that's quite a steal! Choose from attractions like 4D Adventureland which comes with three options - Desperados in 4D, Extreme Log Ride and Journey 2: The Mysterious Island. Ride on a segway or bi-pedal bicycle and journey across the entire island. For those who an immersive nature experience, we suggest the Butterfly Park and Insect Kingdom or the S.E.A Aquarium, where you can see exotic marine life in all their majesty swim by you nonchalantly! Your little ones are sure to enjoy bounding about on the MegaJump or MegaBounce, which you can find at the Mega Adventure Park. And let's not forget Madame Tussauds, where wax replicas of your favourite movie stars are aplenty! This is the next best thing to getting up-close and personal with fame.\n<br></p>\n<h3>Universal Studios Singapore Experience</h3>\n<p>Experience the glory of Hollywood with your Universal Studios Singapore pass. The park is divided into seven different zones, each with a unique theme. Travel across each of these zones, beginning with New York, Madagascar, Sci-Fi City, Ancient Egypt, The Lost World, Far Far Away and Hollywood itself. If you're in the mood to get your blood pumping with crazy rides, you can check out Transformers: The Ride, which is about 2000 ft long with fascinating light installations. Head on over to the Battlestar Galactica inverted rollercoaster ride that drops you from a height of about 150 ft! Those who've come with little kids will thoroughly enjoy child-friendly rides like Madagascar: A Crate Adventure, DinoSoarin' and Sesame Street Spaghetti Space Cheese.\n<br>\nRides can be exhausting, so take a break and enjoy a show. Lights, Camera, Action will have you stunned by a hurricane appearing out of thin air on an empty stage! WaterWorld showcases deathdefying stunts that are a wonder to see. Of course, child-friendly shows like Elmo's TV Time or Shrek's 4D Adventure are also definitely worth a visit.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "105.60",
    highlights:
      "<ul>\n<li>With a two-in-one experience of Universal Studios and Sentosa Island, your experience is guaranteed to be exciting.</li>\n<li>Save over 50% with this booking, and get complete flexibility in return with the ability to use your tickets to Universal Studios and your Sentosa Fun Pass on two different days!</li>\n<li>Choose from over 40 attractions that include 4D Adventureland, Sentosa Merlion, Madame Tussauds, and the S.E.A. Aquarium.</li>\n</ul>",
