    id: "HO8517",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<ul>\n<li>These tickets are applicable to both tourists and Singaporean citizens.</li>\n<li>You cannot take photographs from personal devices while in the Snow chamber.</li>\n<li>Children below 7 must always be accompanied by an adult.</li>\n<li>Food and beverages are prohibited inside the Snow chamber.</li>\n<li>Snow City advises people with medical conditions from visiting the Snow chamber, especially if those conditions could be aggravated by the experience.</li>\n</ul>\n<p><strong>Timings</strong></p>\n<p>Tue-Sun: 10:00 AM- 1:00 PM &amp; 2:00 PM- 5:00 PM </p>\n<p>Public Holidays:10:00 AM- 1:00 PM &amp; 2:00 PM- 6:00 PM </p>\n<p>Closed daily from 1:00 PM - 2:00 PM for cleaning and sanitizing work</p>\n<p><strong>Dress Code</strong></p>\n<ul>\n<li>Wear long pants to keep yourself warm.</li>\n<li>Winter jacket and boots are provided with the admission ticket.</li>\n<li>It is compulsory to wear socks when using the house boots.</li>\n<li>Gloves and pants are available for rent at the venue. Socks are available for purchase.</li>\n</ul>\n<p><strong>Getting There</strong><br></p>\n<ul>\n<li><em>Buses</em>- Take any of the 66, 178, 198, 335 buses and get down at the Snow City stop.</li>\n<li><em>MRT Train</em>- Get down at Jurong East Station on the East West Line and you can walk to Snow City in 10 minutes. Alternatively, you can transfer to buses 335 or 66 from there to Snow City.</li>\n</ul>",
    addressLine: "Snow City Singapore",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["City Pass", "Urban Adventures"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Why You Shouldn’t Miss This</h2>\n<p>Singapore is a tropical country with its typical weather, which is probably the reason Snow City is so popular. It gives people a chance to beat the heat in a very novel way. The Snow City located at the Science Centre allows people to experience snow and cold weather. Coupled with its Inuit theme and multiple attractions like the 60m long snow slide, fun house for children, playgrounds, and fields, it becomes clear that the Snow City is a unique experience that will leave you with fun and cheerful memories.</p>\n<h2>Your Experience</h2>\n<p>Once you enter the Snow City, you will need to put on the jacket and boots to enter the actual snow chamber. If you are not used to low temperatures, you may want to rent some gloves as well. Once you are inside the snow chamber, you can visit any of the four zones inside. You can start from the Artic Snow Playground where you will learn about the Inuit way of life, and then move on to the snow field, and the snow slide. You can find photographers ready to record your memories with your friends and family so that you can relive your experiences long after you leave.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "9.60",
    highlights:
      "<ul>\n<li>Experience snow in Singapore’s first permanent indoor snow centre.</li>\n<li>Be treated to a one of a kind snow blizzard experience.</li>\n<li>Play in the snow playground and learn about the Inuit way of life.</li>\n<li>Take a snow slide from a 60m long and 3-storey high slope.</li>\n<li>Try skiing in on the snow slope in Snow City.</li>\n</ul>",
