          "<h2>Your Experience</h2>\n<p>Gather your best buds and make your way to the world's first NERF Action Xperience Arena! Fuel your play with activities inspired by NERF products, foam-based toys, and weaponry. </p>\n<p>In the Conquer zone, you get to scale high terrains like volcanoes and glaciers, and amp up your confidence. Navigate through NERF worlds with your team and fight zombies in the Compete Zone. No matter what you choose, by the end of your experience, you will have fostered meaningful connections with your fellow players!</p>\n<p>If you'd like to practice first instead, head to the Challenge zone. Work up a sweat as you hone your reflexes with activities like obstacle racing and basketball shooting. For a good dose of fun, go to the Create zone - all you have to do is choose your favorite colors and aim at your target.</p>",
