    id: "HO9316",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<h3>Important Information</h3>\n<ul>\n<li>Entry to the ArtScience Museum is timed</li>\n<li>You will have the option to choose the time slot for your entry during the next step of your booking</li>\n<li>You will only be allowed to gain entry at the time chosen during the booking so we recommend arriving 20 minutes in advance in order to ensure a hassle-free entry</li>\n<li>To effectively manage capacity, admission is staggered to 15-minute intervals. As a result, you may experience some waiting time before entering the museum</li>\n<li>Though your entry is timed, you may explore the ArtScience for as long as you wish</li>\n<li>Children one year or under can enter for free</li>\n</ul>\n<h3>Timings</h3>\n<p><em>ArtScience Museum</em></p>\n<ul>\n<li>Daily from 10:00 AM to 7:00 PM (last admission at 6:00 PM) </li>\n</ul>\n<p><em>Digital Light Canvas</em></p>\n<ul>\n<li>Daily from 11:30 AM to 8:00 PM</li>\n</ul>\n<h3>Getting There</h3>\n<p>The Art Science Museum Singapore is located on the North Promenade of the Marina Sands Bay</p>\n<p><em>By MRT</em></p>\n<p>The CE1/DT16 Bayfront Station is the right ArtScience Museum Singapore MRT Station, as it is linked directly to Marina Sands Bay. Take exit C or D and the museum is a ten-minute walk away</p>\n<p><em>By Bus</em></p>\n<p>The closest bus stop to the ArtScience Museum Singapore is the 03501 Marina Bay Sands Theatre Bus Stop. The bus numbers – 97, 106, 518, 133, and 502 - service the bus stop every day</p>\n<p><em>By Car</em></p>\n<p>The closest ArtScience Museum Singapore Parking is at the North Car Park, with the entrance at Bayfront Avenue near the Sands Theatre</p>",
    addressLine: "6 Bayfront Ave",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Cultural Experiences", "Museums and Gallaries"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>What to Expect</h2>\n<p>One of the iconic cultural attractions in Singapore, the ArtScience Museum is a place to explore technology, art, science, and culture. The building is spread over almost 5000 square meters and has 21 different galleries. In the shape of a lotus, the museum opened in the February of 2011 and has hosted exhibitions that include works of art by Salvador Dali, Leonardo da Vinci, Vincent Van Gogh, and several other prominent artists.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "12.80",
    highlights:
      "<ul>\n<li>Explore the stunningly designed museum, and check out the ArtScience Museum's 21 galleries.</li>\n<li>Discover art, science, and technology, with exhibits featuring everything from da Vinci’s work to particle physics.</li>\n<li>Apart from housing centuries worth of knowledge in the arts and sciences, the museum itself is quite the architectural spectacle as it sits on the waterfronts of the Marina Bay Sands.</li>\n<li>Check out the new permanent exhibition on display, <i> Future World: Where Art Meets Science! </i></li>\n</ul>",
