    type: "attractionsList",
    active: false,
    additionalInfo:
      "<ul>\n<li>The Management reserves the right to amend these Terms and Conditions of Entry without prior notice. For full terms &amp; conditions, visit https://www.wildwildwet.com/safety-first-then-fun.php</li>\n</ul>\n<p><strong>Guest shall:</strong>\n<br>\n1. Observe the dress code (modest swimwear or shorts and T-shirts) at all times for safety purpose. All swimming attire should be free of zippers, rivets, buttons, or other hard objects. Swim diapers are required for children.</p>\n<p><strong>Guest shall NOT:</strong>\n<br>\n1. Smoke in the park area, inclusive of the pools, slides and queue lines.\n2. Bring pets or animals into Wild Wild Wet. Only guide dogs are permitted into the park.\n3. Consume alcohol in slides and pools.\n4. Bring or consume food and drinks purchased or prepared outside Wild Wild Wet.\n5. Engage in commercial filming or photography without the Management's approval.\n6. Tamper with any of the rides, slides, equipment, facilities or fixtures.</p>\n<h2>Know Before You Go</h2>\n<h3>COVID 19 SAFETY</h3>\n<ul>\n<li>All guests and personnel are required to wear masks, except while on rides and attractions</li>\n<li>Safe entry &amp; temperature checks are ensured </li>\n<li>Hand sanitisers are available for use at Entrance and Locker Bay</li>\n<li>Guests are required to maintain social distancing in the Pools and Park</li>\n<li>Park admission is limited, entry on first-come, first-served basis</li>\n<li>Maximum group size of 5 pax from the same household/cohort for entry to the park</li>\n<li>Maximum of 5 pax per Cabana, limited Cabanas available</li>\n</ul>\n<p><strong>Timings</strong></p>\n<p>Off-Peak: Monday to Friday except for Singapore Public &amp; School Holidays 1 pm to 7 pm</p>\n<p>Peak: Saturday, Sunday, Singapore Public &amp; School Holidays 10 am to 7 pm</p>\n<p>From 1st of July:</p>\n<p>Off-Peak: Weekdays, except Gazetted School &amp; Public Holidays\n12pm – 6pm</p>\n<p>Peak: Saturday, Sunday, Gazetted School &amp; Public Holidays\n10am – 6pm</p>\n<p><strong>Singapore School Holidays</strong></p>\n<p>16 Mar - 24 Mar\n1 Jun - 30 Jun\n7 Sep - 15 Sep\n16 Nov - 31 Dec </p>\n<p><strong>Some dates of Singapore Public Holidays</strong></p>\n<p>New Year Day - 1 Jan \n<br>\nChinese New Year - 5 Feb &amp; 6 Feb\n<br>\nGood Friday - 30 Mar\n<br>\nChristmas Day - 25 Dec</p>",
    addressLine: "1 Pasir Ris Cl, Singapore 519599",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Adrenaline Junkies", "Theme Parks"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<p>Wild Wild Wet is one of Singapore’s largest water parks that promises a day of thrills and spills for the whole family. Situated in Downtown East at the eastern part of Singapore, it remains one of the most popular tourist attractions. The impressively expanded park is now home to 16 attractions, with seven new additions such as Kraken Racer, Free Fall and Kidz Zone, that promise to bring excitement to a whole new level for all! From adrenaline-pumping rides to relaxing and gentle ones, visitors are guaranteed a splashing fun-filled day!</p>\n<p>Amidst the fun, the guests' safety remains the top priority. All the lifeguards are specially trained in stringent international standards for lifeguarding at water-based attractions.</p>\n<p>Wild Wild Wet has won numerous accolades in Singapore for its facilities, service, safety, operations, quality, and more</p>",
