        name: "Giant Swing ",
        termsAndConditions:
          "<p><strong>How To Use Your Ticket</strong><br>\r\n\r\nYou will receive an email with your mobile voucher . No need to print. You can skip the ticket line and go directly to the security line with your mobile voucher.</p>\n<p><p><strong>Validity</strong><br> Your tickets are valid only for the day you’ve scheduled the experience. You can visit the park at any time on this day.</p>",
        description:
          "<h2>Why You Shouldn’t Miss This</h2>\n<p>AJ Hackett, a name that is synonymous with adrenaline is a one-of-a-kind adrenaline based theme park. After satisfying more than 4 million people globally, this international brand has now come to Singapore. AJ Hackett Sentosa hosts Singapore’s one and only Bungy Jump, The park also offers a unique Giant Swing Experience, and more which allows you to literally conquer gravity and get rid of your fear of vertigo. So come on down and pump in the adrenaline into your blood and have a thrilling adventure unlike anything Singapore has to offer. The venue is perfect for friend groups and people who are looking for some excitement in their lives. Oh, you can also grab a beer and enjoy some exceptional food here!</p>\n<h3>Bungy Jump</h3>\n<p>Singapore’s only Bungy jump, this activity is what led to the company gaining an international reputation. All you need to do is get upto a height of 47 meters, harness yourself in the straps and fall; gravity will do the rest. Don’t worry, the experience is 100% safe and you’re guaranteed an adrenaline rush as the wind rushes through your face. A true thrill-seekers attraction, the Bungy Jump is fascinating for both the jumper and the spectator. </p>\n<h3>Giant Swings</h3>\n<p>The only dual swings in the world; hop aboard the giant swings and reach speeds of up to 120 km/hr; that’s as fast as most cars on roads. Get on from the ground level and rise to a height of 40 meters. This attraction allows you to do something that most adrenaline based activities do not; a race with your friends. The Giant Swings allow a maximum combined weight(among three people max) of 240 kg per swing. Hop on and begin a race with your friends and see who reaches the bottom first on this one-of-a-kind activity which you can’t do anywhere else on the planet.</p>\n<h3>Skybridge</h3>\n<p>A 2-meter wide transparent glass flooring platform, the Skybridge is perfect for getting over your fear of vertigo. This section is 40 meters long and is located at a height of 47 meters with 1.2-meter high handrails for your support. Walk along this incredible bridge and get 360-degree panoramic views of Singapore all around you. There’s no need for any harnessing system allowing you to casually walk across the length at your own pace. There’s also a challenging glass cube located on the Skybridge which will make your knees tremble. Excited already? Well here’s the best part, with the theme park being located at the beach, your views will go on till the horizon.</p>",
