    description:
      "<p>The coronavirus pandemic is spreading rapidly and has claimed tens of thousands of lives across the world. As the devastation continues to unfold, it is clear to many of us that this event is more daunting than anything we have witnessed in our living memories. And it needs the absolute best of humanity to overcome.</p>\n<p>Singapore is usually bustling with shoppers and tourists. Popular hotspots like Haji Lane, China Town and Marina Bay look like ghost towns right now as the city follows strict lockdown measures to control the Novel Coronavirus spread. Singaporeans whose livelihoods depended on trade are currently left wondering how to survive the uncertain future, which may well extend to weeks and months.</p>\n<h2>The Help Out Project - Singapore</h2>\n<p>While regular lives all over are impacted by the virus and the ensuing lockdowns, it is the isolated vulnerable groups among us that are most exposed and at direct risk. We want to do our bit to support them in these difficult times through this project. All contributions you make will go towards local initiatives and groups that are deeply rooted in the Singapore community and working on the front line to fight this menace.</p>\n<p>We urge you to join hands in our solidarity initiative! Let's help those who are isolated, vulnerable and most exposed to the threat right now.</p>",
