    additionalInfo:
      "<p>For safety purposes, all guests are required to wear proper covered footwear. All guests are also required to keep all loose items secured.</p>\n<p>No photography or videography is allowed during the back-of-house tour.</p>\n<h2>Know Before You Go</h2>\n<p><strong>S.E.A Aquarium Timings:</strong>\n<br>\nS.E.A Aquarium is open daily from 10:00 am - 5:00 pm.</p>\n<p><strong>Getting There:</strong>\n<br>\nTo get to S.E.A Aquarium by train take the Sentosa Express from level 3 of Vivo City. To get here by the public bus system take route RWS8.</p>\n<p><strong>Tour Timings:</strong>\n<br>\nThe tour is held daily at 9:00 am, 11:00 am, 1:00 pm and 3:00 pm and goes on for three hours.</p>",
