    description:
      '<h2>Your  Experience</h2>\n<p>Enter the S.E.A Aquarium before anyone else with your priority access VIP tickets. Home to Singapore’s largest marine life collection featuring 100,000 marine creatures; you’re guaranteed a delightful experience. Your personal guide will curate a special tour just for your group and ensure you gain the most from the S.E.A Aquarium Singapore. See the world’s largest collection of Manta Rays - an endangered species - and learn about the human activities that are destroying the environment.</p>\n<p>You’ll also receive VIP treatment through the tour. With your own lanyard and access to the back-of-house areas, you’ll get more than the normal ticket holders. Explore the fascinating behind the scenes areas of the theme park and witness the never-seen-before side of S.E.A Aquarium. After the tour, you can explore the attraction at your own pace. To plan your day better and to know what to do, refer our guide on <a href="https://www.headout.com/category/518/sea-aquarium-tickets" target="_blank">S.E.A Aquarium.</a></p>',
