    id: "HO7580",
    type: "attractionsList",
    active: false,
    additionalInfo:
      '<p>Resorts World Sentosa is honoured to be awarded the SG Clean quality mark across our resort, including the Casino, hotels, attraction parks, F&amp;B outlets, retail outlets and convention center. The SG Clean Quality mark further highlights our commitment to safe guard our guests and Team Members’ well-being, by adhering to the National Environment Agency’s new benchmark of sector-specific sanitation and hygiene checklists. For more information, please visit www.sgclean.gov.sg</p>\n<h2>Know Before You Go</h2>\n<p><strong>Park Timings:</strong>\n<br></p>\n<ul>\n<li>Adventure Cove Waterpark is open from 10:00 am - 5:00 pm in March and up to 6 pm daily in April &amp; May. Adventure Cove Waterpark™: Please refer to this <a href=https://www.rwsentosa.com/en/attractions/adventure-cove-waterpark/plan-your-visit>webpage</a> for the latest operating hour</li>\n<li>S.E.A Aquarium is open from 10:00 am - 5:00 pm daily in March, and up to 7 pm daily in April &amp; May. S.E.A. Aquarium™: Please refer to this <a href=https://www.rwsentosa.com/en/attractions/sea-aquarium/plan-your-visit>webpage</a> for the latest operating hour</li>\n</ul>\n<p><strong>Validity:</strong></p>\n<p>The combo tickets are valid for a period of 60 days from your scheduled day of the visit. </p>\n<p><strong>Getting There</strong></p>\n<p>Both theme parks are located in close proximity to each other. To get to the venues by train take the Sentosa Express to the Waterfront station. By car, you can arrive by following the left lane on Sentosa Gateway. For a more scenic route, ride the cable car to the Imbiah station before taking the Sentosa Express till Waterfront Station.</p>\n<p><strong>Ultimate Marine Encounters:</strong> \n<br>\nAt Adventure Cove you can delve into the ocean with special marine encounters. Tickets to these must be purchased separately and can be found in our <a href="https://www.headout.com/category/519/adventure-cove-waterpark-tickets?filters=1" target="_blank">Adventure Cove Waterpark tickets collection </a></p>',
    addressLine: "Adventure Cove Waterpark",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Theme Parks", "Zoo & Aquarium"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      '<h2>Your  Experience</h2>\n<p><strong>Adventure Cove Waterpark™</strong></p>\n<p>Enjoy endless splashes of fun at Southeast Asia’s only aquatic water park where thrilling water slides and marine life encounters are both located all in one place. You can get to zoom down Southeast Asia’s first hydro-magnetic coaster, snorkel with 20,000 tropical fish over a colorful coral reef, and feel the magic of wading and interacting with dozens of rays.</p>\n<p>Adventure Cove Waterpark, true to its name, holds all kinds of aquatic wonders for people of all ages. It has 7 water rides, a water maze, and interactive experiences with marine animals. There are also 4 zones dedicated specially for kids to have fun. Plan your day to make the most of your time using our detailed guide on <a href="https://www.headout.com/category/519/adventure-cove-waterpark-tickets?filters=1" target="_blank"> Adventure Cove Waterpark.</a></p>\n<p><strong>S.E.A. Aquarium™</strong></p>\n<p>The Southeast Asia Aquarium (S.E.A. Aquarium), the world’s largest aquarium, is home to more than 100,000 marine animals of over 800 species. Divided into 10 zones with 49 habitats, you can find species including the enormous goliath grouper, giant manta rays, up to 10 species of sharks, and other gentle giants of the sea which is going to leave you in a state of awe.</p>\n<p>The centerpiece display a.k.a the Open Ocean Habitat features a viewing panel measuring 36 meters in width and 8.3 meters in height – a spectacular glass window into a serene blue world teeming with marine animals including manta rays and giant groupers. Plan your day to make the most of your time using our detailed guide on <a href=https://www.headout.com/category/518/sea-aquarium-tickets?filters=1" target="_blank"> S.E.A Aquarium </a></p>',
    dropoff: false,
    exclusions: "",
    fromPrice: "55.20",
    highlights:
      "<h3>Adventure Cove Waterpark™</h3>\n<ul>\n<li>Entry into the waterpark</li>\n<li>Unlimited access to rides and waterslides at the venue</li>\n</ul>\n<h3>S.E.A. Aquarium™</h3>\n<ul>\n<li>Entry into the aquarium</li>\n<li>Access to 49 different habitat zones within the aquarium with opportunities to view up to 800 species of marine life</li>\n</ul>",
