    id: "HO7354",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "<p><strong>Universal Studios Singapore</strong></p>\n<ul>\n<li>The Express Pass allows you skip-the-line access to select rides. This can be added to your base ticket at the venue.</li>\n<li>The layout of USS is that of a ring, with a lake at the center. All the zones are built along the ring. Ensure you know the layout to avoid time-wasting and make use of the USS Map</li>\n<li>The timings of all show changes on a daily basis. Be sure to pick up the daily program sheet from the entrance to plan your day better.</li>\n<li>Arrive early to beat the queues. Plan your visit on a weekday to minimize crowd size.</li>\n<li>Select your ‘must-do’ rides beforehand and complete them before the queues get too long.</li>\n<li>The park offers many facilities like lockers, baby centers, and nursing rooms which can be used at an additional charge. ATMs are also present at the venue.</li>\n</ul>\n<p><strong>S.E.A Aquarium</strong> </p>\n<ul>\n<li>S.E.A Aquarium tickets do not include admission to Typhoon Theatre which is located at the venue.</li>\n<li>Food bars and ATMs are located at the venue.</li>\n<li>Ensure you know the layout of the venue by picking up a S.E.A Aquarium Map from the entrance.</li>\n</ul>\n<p><strong>Note</strong></p>\n<p>Resorts World Sentosa is honored to be awarded the SG Clean quality mark across our resort, including the Casino, hotels, attraction parks, F&amp;B outlets, retail outlets, and convention center. The SG Clean Quality mark further highlights our commitment to safeguard our guests and Team Members’ well-being, by adhering to the National Environment Agency’s new benchmark of sector-specific sanitation and hygiene checklists. For more information, please visit www.sgclean.gov.sg</p>\n<h2>Know Before You Go</h2>\n<h3>Operational Hours</h3>\n<p><em>Universal Studios Singapore</em></p>\n<h3>Timings</h3>\n<p>Please refer to Universal Studios Singapore <a href=https://www.rwsentosa.com/en/attractions/universal-studios-singapore/plan-your-visit>webpage</a> for the latest operating hour</p>\n<ul>\n<li>Mar- 30 Apr 2020: 10:00 AM- 5:00 PM</li>\n<li>1, 2, 9, 16, 23, 24 &amp; 30 May 2020: 10:00 AM- 8:00 PM </li>\n<li>1–5, 7-12, 14-19, 21-26 &amp; 28-30 June 2020: 10:00 AM-8:00 PM</li>\n<li>\n<p>6,13,20 &amp; 27 June 2020: 10:00 AM- 9:00 PM</p>\n</li>\n<li>\n<p>Please note that the below USS activities will be suspended from 27 Mar 2020 until further notice, as part of the new COVID-19 measures:</p>\n</li>\n</ul>\n<p><i> USS Indoor Shows: </i> \nWaterWorld, Pantages Hollywood Theater, Light, Camera, Action! Hosted by Steven Spielberg, Donkey LIVE, Shrek 4-D Adventure</p>\n<p><i> USS Outdoor Shows: </i> \nMel’s Show, Rythem Truck, Raptor Show, <em>FFA Dance of the Magic Beans, </em>Madagascar Boogie Show, <em>Velociraptor (</em>converted into Meet &amp; Greet)</p>\n<p><i> USS VIP Experience </i> \n· Sesame Street Character Breakfast</p>\n<ul>\n<li>\n<p>Lake Hollywood Spectacular: No scheduled performances for the month of Mar and Apr 2020</p>\n</li>\n<li>\n<p>Hollywood Dreams Light-Up Parade: No scheduled performances for the month of Mar and Apr 2020</p>\n</li>\n<li>\n<p>Jurassic Park Rapids Adventure is closed for scheduled maintenance from 23 Mar- 9 Apr 2020</p>\n</li>\n<li>\n<p>Lights, Camera, Action! Hosted by Steven Spielberg is closed for scheduled maintenance from 8-21 May 2020</p>\n</li>\n</ul>\n<p><em>SEA Aquarium</em></p>\n<p>Daily from 10:00 AM- 5:00 PM</p>\n<p>Please refer to S.E.A. Aquarium <a href=https://www.rwsentosa.com/en/attractions/sea-aquarium/plan-your-visit>webpage</a> for the latest operating hour: </p>\n<p><strong>Validity:</strong></p>\n<p>Both tickets are valid for 60 days from the date of purchase.</p>\n<p><strong>Getting There:</strong></p>\n<p>To get to USS by train take the Sentosa Express to the Waterfront station. By car, you can arrive at USS by following the left lane on Sentosa Gateway. For a more scenic route, ride the cable car to the Imbiah station before taking the Sentosa Express till Waterfront Station.\n<br>\nTo get to S.E.A Aquarium by train take the Sentosa Express to level 3 of Vivo City. To get here by the public bus system take route RWS8.</p>",
    addressLine: "Universal Studios Singapore",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Urban Adventures", "Zoo & Aquarium"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      '<h2>Why Book the Tickets with Headout</h2>\n<ul>\n<li>Headout offers the best price guarantee on tickets allowing you to save money with hassle-free booking.</li>\n<li>Your combo ticket is valid for 60 days from your scheduled day of visit offering you plenty of flexibility to plan your visit.</li>\n<li>24/7 helpline to solve any unexpected problems/queries.</li>\n</ul>\n<h2>Your  Experience</h2>\n<p><strong>Universal Studios Singapore</strong></p>\n<p>Experience Hollywood in Southeast Asia! Enjoy the glamor and glitz of Universal Studios, one of Hollywood’s biggest productions, in the heart of Singapore on Sentosa Island. Your day promises to be full of adrenaline, activity, fun, frolic, and excitement regardless of your age. With plenty to offer to individuals of all ages, you’re bound to have a one-of-a-kind experience at this huge theme park. </p>\n<p>The park is divided into seven different themed zones namely New York, Madagascar, Sci-Fi City, Ancient Egypt, The Lost World, Far Far Away, and Hollywood. Each zone holds its own charm and provides entertainment for all. Spend your day traveling across the different zones and trying out the different rides they have to offer. To plan your day at Universal Studios Singapore and know more about the venue, please read our detailed guide on <a href="https://www.headout.com/category/517/universal-studios-singapore" target="_blank"> Universal Studios Singapore.</a></p>\n<p><strong>S.E.A. Aquarium™</strong></p>\n<p>The Southeast Asia Aquarium (S.E.A. Aquarium) is home to more than 100,000 marine animals of over 800 species. Divided into 10 zones with 49 habitats, you can find species including the enormous goliath grouper, giant manta rays, up to 10 species of sharks, and other gentle giants of the sea which is going to leave you in a state of awe.</p>\n<p>The centerpiece display a.k.a the Open Ocean Habitat features a viewing panel measuring 36 meters in width and 8.3 meters in height – a spectacular glass window into a serene blue world teeming with marine animals including manta rays and giant groupers. To plan your day at S.E.A Aquarium and know more about the venue, please read our detailed guide on <a href="https://www.headout.com/category/518/sea-aquarium-tickets?filters=1" target="_blank"> S.E.A Aquarium.</a></p>',
