    id: "HO7610",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "<h3>Night Safari</h3>\n<ul>\n<li>The Night Safari takes around 2-3 hours to cover completely. Admission is given on a slot basis with slots ranging from 7:15, 8:15, 9:15 and 10:15. <strong>Please note that you will be accommodated in the next available time slot upon arrival at the venue.</strong></li>\n<li>Strollers and wheelchairs are available at the venue for toddlers and individuals with impaired movement. Rental charges for strollers are SGD 9 while wheelchairs are free-of-charge.</li>\n<li>Lockers are available at the venue to store your personal belongings. They will be charged at SGD 3. Night Safari also provides other guest facilities such as nursing rooms and first-aid stations.</li>\n<li>Please carry a water bottle, an umbrella and mosquito repellant for personal use.</li>\n<li>The park is spread over a vast area and includes several walking trails; so please ensure you wear comfortable walking shoes to enjoy the park to the fullest.</li>\n<li>Be sure to arrive at the shows at least 15-20 minutes prior their scheduled beginning.</li>\n<li>Uniformed staff members are present through the park and will assist you with any query you might have.</li>\n<li>Japanese and Mandarin commentary is available for the tram ride at an additional price. </li>\n</ul>\n<h3>Jurong Bird Park</h3>\n<ul>\n<li>Use the hop-on hop-off tram to quickly navigate through the park. This will save you considerable amounts of time.</li>\n<li>Strollers and wheelchairs are available at the venue for toddlers and individuals with impaired movement. Rental charges for strollers are SGD 9 while wheelchairs are free-of-charge.</li>\n<li>Lockers are available at the venue to store your personal belongings. They will be charged at SGD 3. Jurong Bird Park also provides other guest facilities such as nursing rooms and first-aid stations.</li>\n<li>Please carry a water bottle, an umbrella and mosquito repellant for personal use. </li>\n<li>The kids' area has wet rides and a change of clothes is required to experience the dry areas. Please carry an extra outfit for the children.</li>\n<li>Be sure to arrive at the show 10-15 minutes prior to their scheduled beginning.</li>\n<li>Uniformed bird keepers are present through the venue to help you with any queries or unexpected issues at the venue.</li>\n</ul>\n<h2>Know Before You Go</h2>\n<p><strong>Ticket Eligibility</strong></p>\n<p>Tickets for both attractions can only be used by tourists and cannot be used by Singapore Citizens and/or Singapore Permanent Residents.</p>\n<p><strong>Timings:</strong> </p>\n<ul>\n<li>Jurong Bird Park is open from Monday to Sunday - 8:30 AM - 6 PM.</li>\n</ul>\n<p><strong>Timings:</strong></p>\n<p><strong>Operating Hours for Night Safari</strong></p>\n<p>Last slot for night safari admission - 9:15 PM</p>\n<p><strong>Tram</strong> </p>\n<ul>\n<li>Last English tram departure - 10:15 PM</li>\n<li>Last multi-language tram departure - 9:30 PM</li>\n<li>Creatures of the Night - The 10:30 PM show is not available on weekends</li>\n<li>All F&amp;B and Retail outlets will close at 11:00 PM</li>\n</ul>\n<p><strong>Ticketing Counters and Collection Kiosks</strong> </p>\n<ul>\n<li>Collection Note Kiosk at Singapore Zoo Entrance - Closes at 10:00 PM</li>\n<li>Collection Note Kiosk at Night Safari Entrance - Closes at 10:15 PM</li>\n<li>Ticketing Counter at Singapore Zoo Entrance - Closes at 10:00 PM</li>\n</ul>\n<p>You can enter at any of the above time slots. Due to limited capacity per time slot, please note that entry is granted on a first come, first served basis onsite and should the current time slot be full, you will have to wait until the next available one to gain entry.</p>",
    addressLine: "Jurong Bird Park",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Nature and Wildlife", "Zoo & Aquarium"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      '<h2>Your Experience</h2>\n<p>Combine two of Singapore’s top attractions for a fun, adventurous day. Explore the fascinating world of Jurong Bird Park and discover the peculiarities of the avian world; following which you can visit the Night Safari for an adventure with the nocturnal animals.</p>\n<h3>Night Safari</h3>\n<p>Venture into the Night Safari, and explore the nocturnal kingdom! Walk through the different zones and take in the plethora of topographies from around the world. Night Safari Singapore is home to over 2,500 animals, of which 38% are threatened, and the animals are housed in open-air exhibits in atmospheres that mimic their natural environments. The Night Safari is divided into the following zones: Himalayan Foothills, Indian Subcontinent, Equatorial Africa, Asian Riverine Forest, Nepalese River Valley and the Burmese Hillside. </p>\n<p>The Safari Tram provides a multi-sensory experience including commentary about all the habitats and animals you come across. The four walking trails, Fishing Cat, Leopard, East Lodge and Wallaby, also provide a unique chance to explore more vividly about the life and fascinating facts about the creatures. You can enjoy token feeding experiences as well, with the big cats in action as they snap up their favorite snacks. There are two-night shows as well; the Thumbuakar Show with pyrotechnics and Creatures of The Night Show that are sure to thrill and excite you. </p>\n<p>To find out the show timings and to know more about the venue, read our detailed guide on <a href="https://www.headout.com/category/522/night-safari-singapore?filters=1" target="_blank"> Night Safari</a>.</p>\n<h3>Jurong Bird Park</h3>\n<p>Explore Asia’s premier bird park and have an avian adventure unlike any other. Visit this scenic location and have face-to-face encounters with bird species from all across the world in environments that mirror their natural habitat. The Hop-on Hop-off tram ride will allow you to cover the park easily and take in the exhibits at a relaxed pace.  </p>\n<p>At Jurong Bird Park you’ll come across bird species that are descendants of dinosaurs such as the Double-Wattled Cassowary and the Emu. You’ll also get to explore the kingdom of penguins. The Penguin Coast is a unique location where you can spot up to four species of these black and white southern creatures.</p>\n<p>The Birds of Play wet and dry play area the Bird Discovery Center are designed exclusively for your little ones to learn while having fun. With multiple special experiences and feeding shows such as the High Flyers Show and the Kings of the Skies Show, at Jurong Bird Park you can interact with the birds up-close and see them at their most active. </p>\n<p>To find out the show timings and to know more about the venue, read our detailed guide on <a href="https://www.headout.com/category/525/jurong-bird-park-singapore?filters=1" target="_blank"> Jurong Bird Park</a>.</p>',
    dropoff: false,
    exclusions: "",
    fromPrice: "48.80",
    highlights:
      "<ul>\n<li>Watch fauna come alive by night and discover 2,500 fascinating nocturnal creatures in their natural habitat as you take in the Night Safari exhibits.</li>\n<li>Climb on the Safari Tram, a 40-minutes immersive experience, that takes you through the reserve park across the 6 different geographical locations.</li>\n<li>Engage in the interactive Creatures Of The Night Show, where you can learn more about the nocturnal abilities of the animals.</li>\n<li>Unlimited access to the Hop-On, Hop-Off tram ride at Jurong Bird Park.</li>\n<li>Discover up to 400 species of birds including 4 species of penguins, several species of pelicans, Emus, parrots and much more!</li>\n</ul>",
