    additionalInfo:
      "<h3>Singapore Zoo</h3>\n<ul>\n<li>ATMs, Lockers, nursing stations are available at the zoo for your use. The charge for lockers is SGD 5 for the first 3 hours followed by an additional SGD 1 for each hour.</li>\n<li>The Zookeepers are spread over the park and will answer any query you might have regarding the animals or the zoo itself. </li>\n<li>Your Singapore Zoo vouchers are valid for an entire day and it is possible to re-enter the Zoo for which you will have to get the voucher stamped for re-entry at the exit. </li>\n</ul>\n<h3>Jurong Bird Park</h3>\n<ul>\n<li>Use the hop-on-hop-off tram to quickly navigate through the park. This will save you considerable amounts of time.</li>\n<li>Strollers and wheelchairs are available at the venue for toddlers and individuals with impaired movement. Rental charges for strollers are SGD 9 while wheelchairs are free-of-charge.</li>\n<li>Lockers are available at the venue to store your personal belongings. They will be charged at SGD 3. Jurong Bird Park also provides other guest facilities such as nursing rooms and first-aid stations.</li>\n<li>Be sure to arrive at the show 10-15 minutes prior to their scheduled beginning.\n.</li>\n</ul>\n<h2>Know Before You Go</h2>\n<p><strong>Ticket Eligibility</strong></p>\n<p>Tickets for both attractions can only be used by tourists and cannot be used by Singapore Citizens and/or Singapore Permanent Residents.</p>\n<p><strong>Timings:</strong></p>\n<ul>\n<li>Jurong Bird Park is open from Monday to Sunday - 8:30 AM - 6 PM</li>\n<li>Singapore Zoo is open from Monday to Sunday - 8:30 AM - 6 PM </li>\n</ul>\n<p><strong>Getting There:</strong></p>\n<p>Singapore Zoo is located on Mandai Lake Road, the venue is easily accessible by cars and metro alike. Take the Red line and transit to a connecting bus, preferably route no 927 or no 138.</p>\n<p>To get to Jurong Bird Park take the MRT on the Green line and transit to bus number 194. In case you're coming by car take the Jalan Bahar towards Jalan Boon Jay and turn right at Jalan Bahar Ibrahim.</p>\n<h3>Pro Tip:</h3>\n<p>Make the most of your combo vouchers by giving these attractions the time they deserve and visiting each park on a different day to fully explore all the sights within.</p>\n<p>However, should you wish to visit both parks on the same day, we recommend that you begin with the Jurong Bird Park since it is not as expansive as the Singapore Zoo. Once you've explored the Bird Park to your heart's content, feel free to move on to the Zoo to  finish your day with the incredible array of animals there.</p>\n<p>Please also note that the kids' area at Jurong Bird Park has wet rides and a change of clothes is required to experience the dry areas. Please carry an extra outfit for the children.</p>",
    addressLine: "Jurong Bird Park",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Nature and Wildlife", "Zoo & Aquarium"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      '<h2>Super Saver Combo Highlights</h2>\n<h3>Singapore Zoo Ticket Highlights</h3>\n<ul>\n<li>Admission voucher to Singapore Zoo </li>\n<li>Ticket to Singapore Zoo is valid for the entire day and can be used to re-enter the park once stamped at the exit</li>\n<li>Guided tram ride with commentary to help you navigate and explore the park</li>\n<li>Discover over 300 species of animals at the open enclosure zoo\n<br></li>\n</ul>\n<h3>Jurong Bird Park Singapore Ticket Highlights</h3>\n<ul>\n<li>Admission voucher to Jurong Bird Park.</li>\n<li>Unlimited access on the Hop-on Hop-off tram allowing you to explore the park with ease.</li>\n<li>Enjoy the chance to hand-feed the birds at Lory Loft and learn about all the feathered creatures.</li>\n<li>Discover up to 400 species of birds including 4 species of penguins, several species of toucans, hornbills, flamingos and many more!</li>\n</ul>\n<h2>Your Experience</h2>\n<h3>Singapore Zoo Experience</h3>\n<p>The Singapore Zoo is Asia’s first open habitat zoo with enclosures designed to replicate the natural environment of the various species at the Zoo. Venture into the Savannah’s of Africa to spot the Hamadryas Baboons or discover the secrets of the rainforest at the Fragile Forest exhibit which resides inside a giant biodome.</p>\n<p>Besides viewing up to 2,800 animals at the Singapore Zoo, you will also be treated to a special tram ride that allows you to explore the park at ease. In addition to this, you can also watch the magnificent display of shows and performance at the venue. For tips on how to plan your day, refer our detailed guide on <a href="https://www.headout.com/category/521/singapore-zoo-vouchers" target="_blank"> Singapore Zoo. </a></p>\n<h3>Jurong Bird Park Experience</h3>\n<p>Discover up to 5,000 birds at Asia’s largest wildlife park, Jurong Bird Park, and make friends with the cute, feathery creatures. Spanning an extensive 20 hectares of hillside terrain, Jurong accommodates birds from all over the world and has a special breeding and research center to promote the conservation of these birds.</p>\n<p>You will also be treated to select bird encounters as you walk through the four aviaries and see these free-flying birds glide through the air. Besides featuring penguins, parrots, toucans, double-wattled cassowaries and many more exotic species, Jurong also hosts bird shows which highlight the skills and talents of the avian species. For tips on how to plan your day, refer our detailed guide on <a href="https://www.headout.com/category/525/jurong-bird-park-singapore" target="_blank"> Jurong Bird Park. </a></p>',
