    id: "HO7613",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "<h3>Singapore Zoo</h3>\n<ul>\n<li>The Singapore Zoo takes around 4-5 hours to cover completely. The zoo is open everyday from 8:30 AM - 6 PM.</li>\n<li>ATMs, Lockers, nursing stations are available at the zoo for your use. The charge for lockers is SGD 5 for the first 3 hours followed by an additional SGD 1 for each hour.</li>\n<li>The Zookeepers are spread over the park and will answer any query you might have regarding the animals or the zoo itself. </li>\n<li>Your Singapore Zoo vouchers are valid for an entire day and it is possible to re-enter the Zoo for which you will have to get the voucher stamped for re-entry at the exit. </li>\n<li>Please carry sun glasses, a hat, an umbrella and a water bottle for personal use. Wear comfortable walking shoes as the zoo has a fair amount of walking.</li>\n<li>Uniformed staff members are present through the park and will assist you with any query you might have.</li>\n</ul>\n<h3>Night Safari Singapore</h3>\n<ul>\n<li>The Night Safari takes around 2-3 hours to cover completely. Admission is given on a slot basis with slots ranging from 7:15, 8:15,9:15 and 10:15.</li>\n<li>Each time slot allows only 1000 people. Please arrive at least 30 minutes prior your desired entrance time. In case all 1000 slots are full, you will be allowed to enter only in the next available time slot.</li>\n<li>Strollers and wheelchairs are available at the venue for toddlers and individuals with impaired movement. Rental charges for strollers are SGD 9 while wheelchairs are free-of-charge.</li>\n<li>Lockers are available at the venue to store your personal belongings. They will be charged at SGD 3. Night Safari also provides other guest facilities such as nursing rooms and first-aid stations.</li>\n<li>The park is spread over a vast area and includes several walking trails; so please ensure you wear comfortable walking shoes to enjoy the park to the fullest.</li>\n<li>Be sure to arrive at the shows at least 15-20 minutes prior their scheduled beginning.</li>\n<li>Uniformed staff members are present through the park and will assist you with any query you might have.</li>\n<li>Japanese and Mandarin commentary is available for the tram ride at an additional price.</li>\n</ul>\n<h2>Know Before You Go</h2>\n<p><strong>Ticket Eligibility</strong></p>\n<p>Tickets for both attractions can only be used by tourists and cannot be used by Singapore Citizens and/or Singapore Permanent Residents.</p>\n<p><strong>Timings:</strong></p>\n<ul>\n<li>Singapore Zoo is open from Monday to Sunday - 8:30 AM - 6 PM</li>\n<li>Last slot for night safari admission - 9:15 PM</li>\n</ul>\n<p><strong>Tram</strong> </p>\n<ul>\n<li>Last English tram departure - 10:15 PM</li>\n<li>Last multi-language tram departure - 9:30 PM</li>\n<li>Creatures of the Night - The 10:30 PM show is not available on weekends</li>\n<li>All F&amp;B and Retail outlets will close at 11:00 PM</li>\n</ul>\n<p><strong>Ticketing Counters and Collection Kiosks</strong> </p>\n<ul>\n<li>Collection Note Kiosk at Singapore Zoo Entrance - Closes at 10:00 PM</li>\n<li>Collection Note Kiosk at Night Safari Entrance - Closes at 10:15 PM</li>\n<li>Ticketing Counter at Singapore Zoo Entrance - Closes at 10:00 PM</li>\n</ul>\n<p>Due to limited capacity per time slot, please note that entry is granted on a first come, first served basis onsite and should the current time slot be full, you will have to wait until the next available one to gain entry.</p>\n<h3>Pro Tip:</h3>\n<p>Make the most of your combo vouchers by giving these attractions the time they deserve and visiting each park on a different day to fully explore all the sights within.</p>\n<p>However, should you wish to visit the parks on the same day, we recommend that you begin with Singapore Zoo since it closes earlier and is the largest of the three parks. Once you've explored the Zoo to your heart's content, feel free to finish your day on your fascinating Night Safari!</p>",
    addressLine: "Singapore Zoo",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Nature and Wildlife", "Zoo & Aquarium"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      '<h2>Your Experience</h2>\n<h3>Singapore Zoo Experience</h3>\n<p>Discover the wondrous creatures at Singapore Zoo in their open enclosure habitats designed to mirror their real-world environment. This conceptual zoo has managed to breed the world’s first polar bear to be born in the tropics who is housed at the Frozen Tundra zone at Singapore Zoo. You can also walk through the other zones to discover the mesmerizing Kangaroos, the enormous Asian Elephants and the ferocious Bengal Tigers among the 2,800 animals here. </p>\n<p>Hop aboard the tram and traverse the park at a more relaxed pace. Learn about the animal species at the zone with the onboard commentary on the tram and gather interesting facts about the creatures on display. You will also be treated to several live shows and performances such as the Animal Friends Show and Splash Safari Show among other. To know more about this wildlife park and find out about the various show times and more, read our detailed guide on <a href="https://www.headout.com/category/521/singapore-zoo-vouchers" target="_blank"> Singapore Zoo</a>.</p>\n<h3>Night Safari Experience</h3>\n<p>Spread over a massive 40-hectare area of tropical forest, Night Safari is Asia’s first Nocturnal wildlife park. Here you can meet the enchanting creatures of the dark like the Himalayan Tahrs and the Brazilian Tapirs. Unlike other nocturnal parks, Night Safari does not reverse the animals day-night cycle; thereby allowing you a memorable experience at the wildlife park.</p>\n<p>Be sure to get abroad the Night Safari Tram Ride, a 40-minute immersive adventure, which takes you into the different zones and allows you to cover the large area at a relaxed pace. If you’re not one for relaxing, check out the walking trails at the venue which features animals from big cats to wallabies. </p>\n<p>In addition to this, Night Safari is famous for their nightly shows which showcase the skills and talents of these animals and the trainers. The Thumbuakar performance, a breathtaking fire display, is also performed at the venue by trainer pyro-warriors. To find out about the timings and more read our detailed section on <a href="https://www.headout.com/category/522/night-safari-singapore" target="_blank">Night Safari</a>.</p>',
    dropoff: false,
    exclusions: "",
    fromPrice: "64.80",
    highlights:
      "<h3>Singapore Zoo Ticket Highlights</h3>\n<ul>\n<li>Guided Tram ride with commentary included in the Singapore Zoo voucher price.</li>\n<li>Explore the plethora of wildlife including Pandas, Elephants, Tigers, Lions and more! With elevated platforms, underwater galleries, and glass observatories enjoy watching the animals frolic around from great vantage points</li>\n</ul>\n<h3>Night Safari Ticket Highlights</h3>\n<ul>\n<li>Experience the fauna come alive by night and spot more than 2,500 fascinating nocturnal creatures in their natural habitat.</li>\n<li>Safari Tram Ride voucher, which is a 40-minutes immersive experience that takes you to the different zones at the venue.</li>\n<li>Witness interactive shows such as Creatures Of The Night Show and the fiery Thumbuakar performance.</li>\n</ul>",
