    id: "HO7358",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<p><strong>Important Information</strong></p>\n<p><em>Accessible Areas</em></p>\n<p>Your tickets include access to garden areas, the Cloud Forest, the Flower Dome and the Supertree Grove, but do not include access to the OCBC Skywalk which connects the Supertrees. Although OCBC Skywalk entry is not included with these tickets, entry can be purchased for 8 SGD (cash only) at the ticketing hub or near the entrance to the OCBC Skywalk.</p>\n<p><strong>Timings</strong></p>\n<p><em>Gardens By the Bay</em></p>\n<p>The greenhouse is open from 9:00 AM to 9:00 PM on all 7 days of the week. However, the last entry time is at 08:00 PM. </p>\n<p><em>Upcoming closure dates for Flower Dome in 2020:</em> </p>\n<ul>\n<li>14 Jan</li>\n<li>3 Mar</li>\n<li>7 Apr</li>\n<li>19 May</li>\n<li>16 Jun</li>\n<li>14 Jul</li>\n<li>18 Aug</li>\n<li>22 Sep</li>\n<li>13 Oct</li>\n<li>10 Nov</li>\n<li>15 Dec</li>\n</ul>\n<p><em>Upcoming closure dates for Cloud Forest in 2020:</em> </p>\n<ul>\n<li>13 Jan</li>\n<li>10 Feb</li>\n<li>2 Mar</li>\n<li>6 Apr</li>\n<li>18 May</li>\n<li>15 Jun</li>\n<li>13 Jul</li>\n<li>17 Aug</li>\n<li>21 Sep</li>\n<li>12 Oct</li>\n<li>9 Nov</li>\n<li>14 Dec</li>\n</ul>\n<p><strong>Reduced Price Tickets</strong></p>\n<p>Entry for children below the age of 2 is free. Child tickets (2-12 years) are available at a reduced price of S$16.</p>\n<p>Please select the right profile type for your group during checkout. Warning: Ensure that you are carrying a valid ID of the members in your group if you select any reduced price tickets during checkout.</p>\n<p><strong>Getting There</strong></p>\n<p>The Gardens are located at 18 Marina Gardens Dr, Singapore 018953.</p>\n<p><em>By Train or Bus</em> </p>\n<ul>\n<li>\n<p>Via Circle Line or Downtown Line: Alight at Bayfront MRT Station (CE1/DT16) and take Exit B and follow the underground linkway. Exit and cross the Dragonfly Bridge or Meadow Bridge into Gardens by the Bay.</p>\n</li>\n<li>\n<p>Via the East - West Line: Alight at Tanjong Pagar MRT Station (EW15) and take Exit C and head towards bus stop no. 03223 located at International Plaza, Anson Road. Hop onto bus no. 400 and alight at bus stop no. 03371 along Marina Gardens Drive.</p>\n</li>\n</ul>",
    addressLine: "Gardens by the Bay",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["City Pass", "Eco tours"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>What to Expect</h2>\n<p>This is a truly stunning location that must not be missed while in Singapore! It was originally a nature reserve park, a government strategy to convert the city from a “Garden City” to a “City In A Garden”. It is much more than a botanical garden, however, with attractions like Cloud Forest, the Flower Dome Conservatory, Heritage Gardens, the various art installations around the parks, and more! </p>\n<p>Discover what plant life is like in the tropical highlands at up to 2,000 meters above sea level. Featuring a 35-meter tall mountain covered with vegetation that shrouds the world’s tallest indoor waterfall, you can take a lift up to the mountaintop, explore the one-of-a-kind biodiversity and the geology maintained here. Learn about the rare species preserved here and the environmental threats they face.</p>\n<p>The Flower Dome was listed in the 2015 Guinness World Records as the world’s largest glass greenhouse! Here, you can enjoy a lovely walk in the temperature-controlled dome, as you marvel at the changing display of plants and flowers from the Mediterranean regions. Learn about how the flora of these regions have adapted to the cool-dry climates of areas like South Africa, California, and parts of Spain and Italy. </p>\n<p>Witness this truly unique sight of vertical gardens measuring between 25-50 meters, designed with large canopies that provide respite from the sun in the day, and see how they come alive at night in a stunning light and sound show! Please note, however, that access to the incredible OCBC Skywalk that connects the Supertrees, giving you an incredible view of the Gardens, comes at an additional cost and that can be purchased on-site.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "12.00",
    highlights:
      '<ul>\n<li>Enjoy access to the two cooled conservatories, Flower Dome and Cloud Forest.</li>\n<li>A must-see while in Singapore, this nature by the Marina Reservoir consists of three waterfront gardens.</li>\n<li>The Cloud Forest is an intricate structure, with many levels, and each with a different theme.</li>\n<li>Visit the Heritage Gardens which has attractions with Indian, Chinese, Malay, and Colonial themes.</li>\n<li>Admire the award-winning orchid flower display, along with the Tulipmania display, available all the way until May 31st and 13th respectively.</li>\n<li>Get the chance to gain entry at discounted rates to Marina Bay Sands Sky along with Gardens by the Bay and it\'s OCBC Skywalk by clicking <a href="https://www.headout.com/tour/7570/singapore/singapore/skip-the-line-access-to-marina-bay-sands-and-gardens-by-the-bay-with-ocbcskywalk">here.</a></li>\n</ul>',
