    additionalInfo:
      "<ul>\n<li>This pass does not include access to Sentosa Cable Car - Sentosa Line.</li>\n<li>Each token is limited to a one-time entry</li>\n<li>Wings of Time tickets must be redeemed at Sentosa Ticketing Counters prior to the show.</li>\n<li>S.E.A. Aquarium and Royal Albatross (Dockside Tour) Sentosa must be redeemed together. This will be counted as two token redemptions.</li>\n<li>Images of Singapore LIVE &amp; Madame Tussauds Singapore must be redeemed together and cannot be visited separately. This will be counted as two token redemptions.</li>\n<li>Sentosa FUN pass must be utilised within the day the first token is redeemed</li>\n<li>Child price is applicable to children aged 3-12 years inclusive</li>\n</ul>\n",
    addressLine: "Sentosa",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Bus Ticket", "City Pass"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<p>Including Singapore’s most iconic tokens such as S.E.A Aquarium, 4D Adventureland and Madame Tussauds, the FUN Pass allows you to choose from up to 40 tokens. </p>\n<p>Available in multiple formats - play up to 3, 5 or 19 tokens of your choice from the list of total experiences covered under the pass- you can experience the best of what Sentosa has to offer. Just choose the pass that suits you best, and let the fun begin! Whether you’re an adrenaline junkie, or simply want something adventurous for the whole family, the Sentosa FUN Pass is for you. </p>\n<ul>\n<li>\n<p><strong>Sentosa FUN Pass Play 3:</strong> Play up to any 3 tokens within a day.</p>\n</li>\n<li>\n<p><strong>Sentosa FUN Pass Play 5:</strong> Play up to any 5 tokens within a day.</p>\n</li>\n<li>\n<p><strong>Sentosa FUN Pass Play 19:</strong> Play up to any 19 tokens within a day.</p>\n</li>\n</ul>\n<h2>Sentosa FUN Pass Highlights</h2>\n<ul>\n<li>The Sentosa FUN Pass is your ticket to unlimited fun at a great bargain.</li>\n<li>With something for everyone, the pass allows you to choose from up to 40 tokens on Sentosa Island.</li>\n<li>Enjoy a variety of rides and tokens and experience the best of what Sentosa has to offer.</li>\n</ul>\n<h2>Some Tokens You Can Choose From</h2>\n<ul>\n<li>4D AdventureLand: Desperados in 4D</li>\n<li>4D AdventureLand: Extreme Log Ride</li>\n<li>4D AdventureLand: Journey 2: The Mysterious Island </li>\n<li>Bi-Pedal Bicycle (1 Hour)</li>\n<li>Butterfly Park and Insect Kingdom</li>\n<li>Fort Siloso Combat Skirmish: Indoor Maze</li>\n<li>MegaBounce or MegaJump @ Mega Adventure Park</li>\n<li>MOSH!</li>\n<li>Segway Fun Ride </li>\n<li>Sentosa Merlion</li>\n<li>Tiger Sky Tower</li>\n<li>Trick Eye Museum Singapore</li>\n<li>Wave House Sentosa- Catch-A-Wave (1 Try)</li>\n<li>Wings of Time (Standard Seat)</li>\n<li>Madame Tussauds Singapore </li>\n<li>Images of Singapore LIVE </li>\n<li>S.E.A Aquarium </li>\n<li>K-Live Sentosa (Hologram)</li>\n</ul>\n<h2>Is the Sentosa Fun Pass good for me?</h2>\n<p>The biggest advantage that the Sentosa FUN Pass has to offer is the savings. When it comes to savings, you the potential to save anywhere between 40%. Let us take a closer look at the cost-benefit analysis of a Sentosa Day FUN Pass.</p>\n<p>Sentosa FUN Pass Play 3 Cost: SGD 51</p>\n<p>Individual Ticket Prices<br>\nWavehouse- Catch a Wave (2 Tries): SGD 30<br>\n4D AdventureLand Extreme Log Ride: SGD 38<br>\nOla Beach Club Stand Up Paddle Board (30 minutes): SGD 18<br></p>\n<p>Total: SGD 86</p>\n<p>The pass will cost you SGD 51 while individually, the tickets will cost a total of SGD 86. That is a saving of 40%.</p>",
