        id: "HO73641",
        ticketTypeFormat: "QRCODE",
        name: "General Admission ",
        termsAndConditions:
          "<p>You will receive an email confirmation with your voucher. No need to print. Please display the same on your mobile phone at the time of pick-up with a valid photo ID.</p>\n<p><strong>Redemption and Boarding Location:</strong> </p>\n<p>City Tourist Hub @ Marina Square Shopping Mall #01-221 </p>\n<p><strong>How to get there:</strong> </p>\n<p>The Marina Square Shopping Mall is incredibly accessible, whether you're commuting by bus, MRT or taxi.</p>\n<p>If you're travelling by MRT NS25/EW13, alight at City Hall MRT Station and walk through CityLink Mall to reach Marina Square.</p>\n<p>If you're travelling by MRT CC3, alight at Esplanade MRT Station and access Marina Square via the basement integrated walkway - Marina Link, which is located just next to Esplanade MRT Station.</p>\n<p>If you're travelling by CC4/DT15, alight at Promenade MRT Station and walk through Millenia Walk to reach Marina Square.</p>\n<p>The nearest MRT Station is Promenade, exit A. </p>\n<p>If you are travelling by bus, the following buses will all drop you at Raffles boulevard, from where you can make your way to the redemption point: 36, 36A, 36B, 56, 75, 77, 97, 97E, 106, 107M, 171, 195, 700A, 857, 960, 961C, NR2, NR5, NR7, NR8.</p>\n<p>Nearest entrance is next to the taxi stand &amp; 7-Eleven store, which is where you'll be dropped if you're taking a taxi.</p>",
        description:
          "<h2>Sight’s Covered</h2>\n<ul>\n<li>Marina Square</li>\n<li>Marina Bay</li>\n<li>Marina Barrage</li>\n<li>Marina Bay Sands</li>\n<li>Gardens By the Bay</li>\n<li>Bay South</li>\n<li>Singapore River</li>\n<li>Merlion</li>\n<li>Helix Bridge</li>\n<li>Floating Stadium</li>\n<li>Marina Bay Financial Center</li>\n<li>Singapore Flyer</li>\n</ul>\n<h2>Your Tour</h2>\n<p>The fun begins as you step aboard the authentic revamped Vietnam War era vehicle- an amphibious vehicle that runs on land and on water. Accompanied by a professional guide, your day will begin with a drive around the city’s most prominent landmarks including Padang, City Hall and the War Memorial. Next, it’s time for ‘splashdown’ in the waters of the Marina Bay. Experience the beauty of the Lion City as you take in breathtaking views of the iconic Merlion, the Marina Bay Sands, the Esplanade Theatres, the Helix Bridge and many more landmarks that define the amazing Singapore skyline.</p>",
