    id: "HO7881",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "<ul>\n<li>\n<p>There are 2 ATM machines in the park.</p>\n</li>\n<li>\n<p>American Express, debit cards, China Union Pay (CUP), VISA and Master credit cards are accepted in the park. Personal and travellers cheques are not accepted.</p>\n</li>\n</ul>\n<h2>Know Before You Go</h2>\n<p><strong>Timings</strong></p>\n<p>Legoland Malysia's usual operating hours are from 10:00 AM to 6:00 PM with extended closing time on weekends and public and school holidays.</p>\n<p><strong>Reduced Price Tickets</strong></p>\n<p>Child tickets (3-11 years) are available at a reduced price of S$41.</p>\n<p><strong>Getting There</strong></p>\n<p>Legoland Malaysia is situated at Iskandar Puteri (formerly known as Nusajaya), Johor, Malaysia. Iskandar Puteri is located west of Johor Bahru, in close proximity to Port of Tanjung Pelepas and Gelang Patah. It is also about a 55-minute drive from Singapore's Changi International Airport, and 20 minutes from Johor's Senai International Airport. You can get to Legoland Malysia by car or bus.</p>\n<p><strong>Accessibility</strong></p>\n<p>For visitors with mobility impairment, wheelchairs and strollers can be rented at the park and are chargeable.</p>\n<p><strong>Restrictions</strong></p>\n<p>No dogs or pets can be admitted into the park. Outside food and beverages are not allowed into the park. Alcoholic consumption and smoking is strictly prohibited.</p>",
    addressLine: "Legoland Malaysia",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Theme Parks", "Urban Adventures"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>What to Expect</h2>\n<p>The theme park is first of its kind in Malaysia and boasts of 40+ interactive rides, shows, and attractions. Spread over 76 acres of sprawling land, Legoland puts no barriers on your creativity and encourages you to let your imagination run wild. Build anything you please with the Lego bricks at the venue. Head into the biggest Lego store in Asia, experience the heart-racing rides, jump on the merry-go-rounds and much more at Malaysia's first international theme park. </p>\n<p><image> Hop over to the land of imagination, where you can build anything you imagine with Lego bricks and test your creation's structure on the earthquake table! </p>\n<p><image> Build and program Lego robots at Lego Technic, then fire laser blasters and plunge down a tropical jungle at Land of Adventure. </p>\n<p><image> Check out incredible Asian landmarks at Miniland – all recreated using over 30 million Lego bricks! </p>\n<p><image> Take a train, captain your own boat or pilot an airplane at Lego City, then go for a thrilling ride on the Dragon Roller Coaster Shop at The Big Shop, the only place you'll find the largest selection of LEGO toys in Asia! </p>\n<p><image> Fight the waves at the LEGO wave pool, laze along the Build-A-Raft lazy river and slide down tube and body slides under the cheerful sun.</p>\n<p><em>Legoland Theme Park and Legoland Water Park both require separate tickets for entry. We highly recommend that you visit both for the complete Legoland experience, which you can, with our combo ticket! For those who'd like to visit either the theme park or water park only, however, we do have separate tickets for the same, which you can choose during checkout.</em></p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "33.60",
    highlights:
      "<ul>\n<li>Enjoy up to 40 rides, shows, and attractions.</li>\n<li>Witness the interactive exhibits constructed by the LEGO builders.</li>\n<li>Build and program your own Lego robots at Lego Technic.</li>\n<li>Explore up to seven different themed areas at the park.</li>\n</ul>",
