    id: "HO7370",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "<ul>\n<li>Please note that the Skyline Luge will be closing early on the 2nd of November. The last ride will be at 4:45 PM and will close at 5 PM.</li>\n</ul>\n<h2>Know Before You Go</h2>\n<p><strong>Timings</strong></p>\n<ul>\n<li>Thur- Mon: 11:00 AM- 7:30 PM (last ride at 7:00 PM)</li>\n<li>Fri &amp; Sat: 11:00 AM- 9:30 PM (last ride at 9:00 PM)</li>\n<li>Closed on Tue &amp; Wed</li>\n</ul>\n<p><strong>Getting There</strong></p>\n<p>Skyline Luge Sentosa is located between Imbiah Lookout and Siloso Beach, right at the heart of Sentosa Island. These are also the two entrances to Skyline Luge Sentosa, and you can choose the one that is most convenient to you. </p>\n<p>You can get to the Imbiah Lookout entrance by bus, monorail, cable car or car, as this entrance has parking. </p>\n<p>You can get to the Siloso Beach entrance by bus, monorail, tram or car, as this entrance has parking.</p>",
    addressLine: "Skyline Luge",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Outdoor Adventures", "Ziplines"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>What to Expect</h2>\n<h3>A Fun-filled Experience</h3>\n<p>This is one of the most exciting outdoor adventure activities that one shouldn’t miss when in Singapore! Hop on this mix of go-kart and toboggan sled that works on the basis of gravity. Race down the purpose-built track where you can control your descent by using the handlebars, accelerator or brakes. You can also hop on the open-cabin Skyline for a ride to the top of the tracks, from where you can enjoy panoramic views of the city Skyline and beyond. You can choose to ride Skyline at night, which promises to be a romantic experience as the city lights are spread out under your feet!</p>\n<p><image> Zip about in your luge on purpose-built tracks.</p>\n<p><image> The ideal day out for the entire family!</p>\n<p><image> The Skyline Luge by night is sure to be a romantic and mesmerizing experience!</p>\n<h3>Ride Options:</h3>\n<p><strong>Skyride and Luge (2 rounds)</strong>\n Include 2 Luge &amp; 2 Skyride\n<br>\n<strong>Skyride and Luge (3 rounds)</strong>\n Include 3 Luge &amp; 3 Skyrides\n<br>\n<strong>Skyride and Luge (4 rounds)</strong>\nInclude 4 Luge &amp; 4 Skyrides</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "16.80",
    highlights:
      "<ul>\n<li>Enjoy this truly thrilling experience that was invented in Rotorua, New Zealand, in its only Asian incarnation in Sentosa.</li>\n<li>Half go-kart, half toboggan ride, this unique slide ride will have you zipping down a purpose-built track with the thrill of gravity.</li>\n<li>Enjoy zipping down this 2.6-kilometer track in state-of-the-art luges with your friends and family.</li>\n<li>Get a chance to hop on the 4-seater Skyride and marvel at the bird's eye views of the entire city’s skyline, Sentosa Island, and even the South China Sea!</li>\n</ul>",
    hoursOfOperation: "",
