          "<p><strong>How to Redeem your Tickets</strong></p>\n<p>You will receive an email with your Marina Bay Sands Skypark Observation Deck voucher. No need to print. Display your mobile voucher at the Marina Bay Sands Box Office.</p>\n<p><strong>Validity</strong></p>\n<p>Your tickets are valid for 180 days from the date of issue.</p>",
        description:
          "<h2>What to Expect</h2>\n<p>Perched 200 m from ground level and atop the clouds, the Marina Bay Sands Observatory stands tall in the heart of Singapore. Witness a one-of-a-kind experience at the Sky Park as it floats soaring above Singapore. Take a walk along the giant observation deck and witness the scenic view of the city down below as you look at the many attractions from a bird's eye perspective.</p>\n<p>The Sky Park appears as though it floats on the top of three soaring hotel tower and is a must see in Singapore! 57 levels high and with a broad walkway, the Sky Park is the perfect viewpoint at the zenith of Marina Bay Sands! See the nearby Gardens by the Bay from the vantage point that this unique observation deck provides, as well as the iconic Singapore Flyer as you gaze out at the city. Though the view from the observation deck is stunning on even the worst days, the panoramic vistas you get to admire as the sun sets are truly unparalleled.</p>\n<p>Additionally, witness the city of Singapore come to life at discounted prices on an unforgettable cable car ride. Skip the line and take to the skies to enjoy unparalleled views of Singapore and all its icons. With the round-trip pass, you can complete the entire trip irrespective of the station you start at.\nThe spacious cabins are wheelchair friendly and can accommodate strollers too. You can also visit Mount Faber Park, one of Singapore’s oldest hilltop parks. Enjoy many stunning photo opportunities around the lush greenery here. Cross through a skyscraper and go across the harbor to reach Mount Faber. On the Sentosa Line, fly over the jungle, sand, and sea and see the many attractions from a unique vantage point.</p>",
