        description:
          "<h2>What to Expect</h2>\n<p>Don’t miss the ultimate sightseeing experience! Take to the skies to enjoy unparalleled views of Singapore and all its icons. You can also visit Mount Faber Park, one of Singapore’s oldest hilltop parks. Enjoy many stunning photo opportunities around the lush greenery here. Cross through a skyscraper and go across the harbor to reach Mount Faber. On the Sentosa Line, fly over the jungle, sand, and sea and see the many attractions from a unique vantage point.</p>\n<p>The Singapore Cable Car has two lines:</p>\n<ul>\n<li>Mount Faber Line that runs between Mainland Singapore and Sentosa Island.</li>\n<li>Sentosa Line that runs within Sentosa Island.</li>\n</ul>\n<p><strong>Mount Faber Line</strong></p>\n<p>The line begins on Mount Faber Station, Faber Peak and continues through the Harbourfront Station towards the third and last stop on the Mount Faber Line, Sentosa Station.</p>\n<p><strong>Sentosa Line</strong></p>\n<p>The Sentosa Line begins at Merlion Station and continues on to the Imbiah Lookout Station before ending at Siloso Point Station.</p>\n<p><strong>Suggested Route</strong></p>\n<ul>\n<li>Start your trip from the Harbourfront Station. The Harbourfront station is located on Level 15 of Harbourfront Tower 2. </li>\n<li>Take the cable car towards Mount Faber Station. This route is often less crowded and provides spectacular views of Singapore and the harbour. </li>\n<li>Alight at the Mount Faber Station and enjoy the beautiful views of Central Business District and Keppel Harbour.</li>\n<li>From Mount Faber Station, travel all the way towards Sentosa Station. On this route, you will see Keppel Harbour, Singapore Cruise Terminal, Adventure Cove Waterpark and Universal Studios Singapore. This completes the Mount Faber Line.</li>\n<li>Get down at the Sentosa Island and walk to Imbiah Lookout Station to get on the Sentosa Line. The Imbiah Lookout Station is located 5 minutes on foot from the Sentosa Station.</li>\n<li>From the Imbiah Lookout Station, you can go to either Merlion Station or Siloso Point Station. </li>\n<li>On the way to Merlion Station from Imbiah Station, you will see Skyline Luge's tracks, Skylift and the beach.</li>\n<li>From Imbiah Station to Siloso Point Station, you will see Mount Imbiah's jungle, MegaZip Adventure Park, Fort Siloso and Siloso Beach.</li>\n<li>To head back to the mainland, get down at Imbiah Lookout Station, walk to Sentosa Station to get on the Mount Faber Line and get down at the Harbourfront Station.</li>\n</ul>",
