    id: "HO7375",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<h3>Important Information</h3>\n<ul>\n<li>All guests must make prior bookings before heading down to the attraction</li>\n</ul>\n<h3>Timings</h3>\n<ul>\n<li>The Trick Eye Museum has resumed its operations from 11 July, 2020.</li>\n<li>It is open from Thursday to Tuesday, from 10 AM to 6 PM (last admission at 5 PM).</li>\n<li>Closed Days: Wednesday.</li>\n</ul>\n<h3>Getting There</h3>\n<p>Trick Eye Museum is located on Waterfront @ Resorts World Sentosa, 26 Sentosa Gateway. The nearest MRT station is Harbourfront. To access the museum via Sentosa Expressway, get down at the Waterfront Station.</p>",
    addressLine: "Trick Eye Museum",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Museums and Gallaries", "Virtual Reality"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<p>‘Trick of the Eye’ refers to the traditional art technique Trompe-l’oeil, which turns 2D paintings into 3D images using the principles of optical illusions. At the Trick Eye museum, the visitors ‘become one’ with the art, as they nurture their creativity and interact with all the displayed exhibits. Here, you have the option to become the exhibition in itself. You are encouraged to step inside the installations and recreate memorable photos using your own creativity and imagination. </p>\n<p>Take your experience to a higher level with the Trick Eye Museum's Augmented Reality App. As you look through the app, the exhibition comes to life with the magical appearance of an augmented reality world. Discover this new surreal world with the help of the Trick Eye Museum app that you can download from the Google Play Store or App Store. Looking through the app, you will see your photos and videos manifest themselves with animals, magic, fireworks and other special effects!</p>\n<p>With six themed zones, each uniquely crafted to awaken all five senses, you will be entertained by mystical encounters, overcome your fears, feel the love in the air, and feel your adrenaline rush as you experience the trick world!</p>\n<ul>\n<li>\n<p><strong>Mystery:</strong> Discover the hidden secrets of Trick Eye’s 4-dimensional space. Touch and feel the surroundings as you experience the magic of Media Art, Ames Room and Dining Table</p>\n</li>\n<li>\n<p><strong>Excitement:</strong> Free your inner child as you taste the thrill and feel like a real adventurer at Trick Eye</p>\n</li>\n<li>\n<p><strong>The Supernatural:</strong> Overcome your fears and befriend the not-so-scary ghosts as you enjoy being a part of multiple ‘spooky’ paranormal scenes</p>\n</li>\n<li>\n<p><strong>The Romantic Fairytales:</strong> Love is in the air! Lose yourself in the world of fairytales as you swim like Ariel, dance on ice like Elsa or fly on the magic carpet like Aladdin</p>\n</li>\n<li>\n<p><strong>The Land of Fantasy:</strong> Here, fantasies are no longer a dream. See the magical realms of fantasy come to life and experience a world where everything is picture-perfect</p>\n</li>\n<li>\n<p><strong>The Trick World:</strong> Finally, visit the Trick World, a collection of the most loved Trick Eye exhibits and explore the impossibilities of reality.</p>\n</li>\n</ul>",
    dropoff: false,
    exclusions: "",
    fromPrice: "14.00",
    highlights:
      "<ul>\n<li>Visit the Trick Eye Museum and watch as 2D paintings on the walls, floors, and ceilings appear to pop out and come to life.</li>\n<li>With an art technique that turns 2-dimensional paintings into 3- dimensional masterpieces through the use of optical illusion, the Trick Eye or Trick-of-the-Eye museum gives visitors the chance to awaken all their senses.</li>\n<li>Enter a world of augmented reality with the help of Trick Eye Museum's free app and discover a hidden world where animals, magic, and special effects come to life.</li>\n<li>Step inside the paintings and watch a colorful, tricky story unfold before your camera</li>\n<li>Enjoy a limited  <strong>Buy 2, Get 1 Free</strong> offer that lets you share this experience with your loved ones</li>\n<li>All guests must make prior bookings before heading down to the attraction</li>\n</ul>",
