    additionalInfo:
      '\n<h2>Is This Pass Good For Me</h2>\n<p>Touring Singapore with an iVenture Flexi pass is an extremely efficient manner to experience the best of Singapore. Some of its advantages are:</p>\n<p>The iVenture Flexi Pass allows you to comfortably visit a select number of attractions of your choice over a period of 5 days. This allows you to comfortably plan your trip out and not rush through all the attractions in the city.</p>\n<p>With only a single card in hand, you have the option to visit over 20 attractions. Simply show your card at the attraction and enter it without purchasing additional tickets.\nThe biggest advantage though are the savings. The iVenture Flexi pass provides you the opportunity to save up to 20% on attraction entrance prices. Let\'s take a closer look at the cost-benefit analysis of the iVenture Flexi Pass.</p>\n<p>iVenture 3 Attraction + Universal Studios Singapore or iFly Singapore Flexi Pass Cost - SGD 185</p>\n<p>Individual Ticket Prices:<br>\nUniversal Studios Singapore: SGD 72<br>\nAdventure Cove: SGD 34<br>\nSEA Aquarium: SGD 35<br>\nSingapore Flyer: SGD 60<br></p>\n<p>Total: SGD 201</p>\n<p>The iVenture Flexi Pass will cost you SGD 185 while you will be spending SGD 201 if you were to buy individual tickets. If you visit these attractions, then you will be saving up to 8% on the general admission prices with the iVenture Flexi Pass.</p>\n<h3>Important Info</h3>\n<p>In rare cases, some attractions may be closed for scheduled maintenance. We recommend checking the <a href="https://www.iventurecard.com/" target="_blank" draggable="false">iVenture Card website</a> and planning ahead to avoid closure dates.</p>',
