    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<p><strong>Timings</strong></p>\n<p>9:30 AM-7:00 PM daily (Last entry at 6:30 PM)</p>\n<p><strong>Accessibility</strong></p>\n<p>Not wheelchair accessible</p>\n<p><strong>Getting There</strong></p>\n<p>These bus lines stop near Butterfly Park &amp; Insect Kingdom: BUS A, RWS8</p>\n<p>Cable Car lines: MOUNT FABER LINE</p>\n<p>Underground lines: CIRCLE LINE, NORTH EAST LINE</p>",
