    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<p>Perhaps Sentosa’s most lively location, life is teeming with colors and energy at the Butterfly Park &amp; Insect Kingdom. Modeled like an outdoor conservatory, you can find over 1,500 butterflies here, from over 50 different species. Head to the Pupa House, an exhibition of preserved butterfly pupae for to learn all about the various stages in these fascinating creatures’ lives. </p>\n<p>Head to the 70-meter long cave, the Insect Safari Tunnel that is home to insects in their natural habitat, such as the Dynastes Hercules beetle, giant scorpions, and millipedes. Don’t miss the exciting Firefly Enclosure Show at night. Other than the insect life, the park also has a Bird Aviary, as well as an area exclusively dedicated to reptiles.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "6.40",
    highlights:
      "<ul>\n<li>Within the busy and bustling city of Singapore, step into a vibrant world of life and color</li>\n<li>Be surrounded by over 1,500 butterflies, and see varied exotic insect species</li>\n<li>From enthusiasts of nature, to curious tourists, to children- this park has something for everyone</li>\n</ul>",
