    additionalInfo:
      "<ul>\n<li>Photography &amp; the use of selfie sticks is prohibited in the galleries</li>\n<li>Visitors are recommended to switch off their mobile phones</li>\n<li>The ticket is open dated so you can visit the museum on a day of your choice</li>\n</ul>\n<h3>Validity</h3>\n<p>This ticket is valid for 1 month from the date of purchase</p>",
