    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>10-Second Takeaway</h2>\n<ul>\n<li>Founded in 1887, this is Singapore’s oldest museum</li>\n<li>Enjoy one full day exploring over 1,700 artefacts preserved through history</li>\n<li>Be a part of the many informative and fun exhibitions that the museum hosts</li>\n<li>Learn about the history of Singapore from its inception to daily life now</li>\n</ul>\n<p><br></p>\n<h2>Your Experience</h2>\n<p>Dating back to 1887, the National Museum of Singapore is the country’s oldest museum and currently holds more 1,700 cultural and historical artefacts. The building itself is an architectural marvel, and now the galleries have adopted the latest technologies in their displays and exhibitions. Learn all about the quaint beginnings of Singapore to its status of a global metropolis today. Walk into any of the frequent exhibitions, screenings, talks, festivals, etc that the museum hosts all year round.</p>",
