    id: "HO7381",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "<ul>\n<li>Wear clothes that are not too baggy or tight</li>\n<li>Please make a note of the height and weight restrictions for the various experiences:</li>\n<li>MegaZip - Minimum weight 30 Kg and maximum weight 140 Kg</li>\n<li>MegaClimb - Minimum weight 120 Kg and minimum height 1.2 meters </li>\n<li>MegaJump - Minimum weight 30 Kg and maximum weight 120 Kg</li>\n<li>MegaWall - Minimum weight 25 Kg and maximum weight 120 Kg</li>\n<li>MegaBounce - Minimum weight 10 Kg and maximum weight 90 Kg</li>\n</ul>\n<h2>Know Before You Go</h2>\n<h3>Ticket Information</h3>\n<p>This ticket offers the following variants you can choose from:</p>\n<ul>\n<li>MegaJump and MegaClimb </li>\n<li>MegaJump, MegaClimb, and MegaZip</li>\n</ul>\n<h3>Timings</h3>\n<ul>\n<li>Mega Adventure Park has resumed its operations from 11 July 2020.</li>\n</ul>\n<p><i> Operating Hours </i></p>\n<ul>\n<li>\n<p>Mon, Thu, Fri<br>\n1 PM to 7 PM.</p>\n</li>\n<li>\n<p>Sat &amp; Sun <br>\n11 AM to 7 PM.</p>\n</li>\n<li>\n<p>Closed Days <br>\nTue &amp; Wed.</p>\n</li>\n<li>\n<p>Last Admission <br>\nMegaZip (6:45 PM).<br>\nMegaClimb (5:30 PM). <br>\nMegaJump (5:30 PM).<br>\nMegaBounce (6:45 PM).<br></p>\n</li>\n</ul>\n<h3>Getting there</h3>\n<p>From VivoCity or HarbourFront Centre metro follow signs for the Sentosa Express in VivoCity. From Level 3 in VivoCity, take the Sentosa Express Monorail. Proceed to and alight at Beach Station (the final stop on the Monorail).</p>\n<p>From Beach Station, hop on the free tram towards Siloso Beach and alight at the 3rd stop. The counter for Mega Adventure Park is on the left. </p>\n<h3>Validity</h3>\n<p>The tickets are valid for 60 days from the date of purchase.</p>",
    addressLine: "Mega Adventure Park",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Adrenaline Junkies", "Outdoor Adventures"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<p><strong>MegaZip</strong></p>\n<p>Skip the line and enter the Mega Adventure park and begin flying at high speeds over the forests of Sentosa’s beach island promises to be a memorable experience filled with thrills and adrenaline! Fly at 60 km/hr over this 450m long zip line, touted as Southeast Asia’s most extreme zip line experience. At a height of 75m, feel like a daredevil eagle as you speed past friends and family, as it features three side-by-side zip lines. Following a brief and comprehensive safety briefing, you’re good to go! Mega Zip will take you on a breathtaking adventure as you swoop from the jungles of Imbiah Hill to the white sands of Siloso Beach.</p>\n<p><strong>MegaJump</strong></p>\n<p>This one is not for the faint-hearted, as you jump down 15-meters, with the complete sensation of a free-fall, but with the highest standards of safety! The custom-made safety harnesses were developed in the UK, and are operated here by a highly trained staff, that allows you to experience this without any worries.</p>\n<p><strong>MegaClimb</strong></p>\n<p>Channel your inner Tarzan and try your hand at MegaClimb! This one features 36 obstacles in the jungle on Imbiah Hill, linked across giant eucalyptus trees that are five to 15-meters high. It's a daring challenge!</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "25.60",
    highlights:
      "<ul>\n<li>Fulfil your dreams of flying, as you zip across the beaches and jungles of Sentosa</li>\n<li>At a height of 75m, fly at 60 km/hr on this 450m long zip line as you race against your friends and family, on MegaZip</li>\n<li>MegaJump allows you to enjoy the sensation of free-falling; but with complete safety</li>\n<li>MegaClimb includes overcoming obstacles in the jungle that are linked across giant eucalyptus trees</li>\n<li>Discover a whole new world of excitement, thrills, and possibilities</li>\n</ul>",
