    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<p><strong>Tour Timings</strong></p>\n<ul>\n<li>Monday to Friday - 10 AM to 4 PM</li>\n<li>Saturdays, Sundays and other public holidays - 9 AM to 12 PM</li>\n</ul>",
    addressLine: "8 Grange Rd, Singapore 239695",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Indoor Adventures", "Theme Parks"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Why You Shouldn’t Miss This</h2>\n<p>Singapore is known as a commercial and business hub. It is considered the most technologically advanced city and is also renowned as the world’s smartest city. Numerous parks are present here, some of which are as Legoland, Universal Studios, Gardens By The Bay, and Bounce Singapore. Located in the center of the city at Orchard at Cathay Cineleisure Level 9, Bounce is often considered one of the top indoor amusement parks in the world. Numerous zones exist in this trampoline park, and it houses a Ninja Warrior-esque adventure course, aptly named the X-Park, the first of its kind in Asia. Additionally, the “Leap of Faith” is another exciting ride that is extremely popular amongst the visitors.</p>\n<h2>Your Experience</h2>\n<p>Experience the unparalleled joy of jumping around on a trampoline. Whether you are three years old or an adult, the trampoline is guaranteed to bring a wide smile to your face! Regardless of your age, the indoor playground is the perfect stressbuster. For sports and adventure lovers, it is the perfect environment to forget about everything else. High-energy abounds all around you, and it will prove to be an unforgettable and immersive experience. If you are a fitness enthusiast, the X-Park will prove to be the ideal place. Created in collaboration with the makers and architects of the most famous bouldering and parkour courses in the world, the course has several routes for varying levels of expertise. Your core strength and cardiovascular endurance will be tested to its limits and will help improve your stamina and fitness. Going around the obstacles is like a puzzle, and it will prove to be the perfect physical and mental exercise. The 1 hour session will leave you tired, yet utterly satisfied and content.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "21.60",
    highlights:
      "<ul>\n<li>Test your coordination, strength and stamina, along with your decision-making skills on the unique X-Park obstacle course.</li>\n<li>Experience the first of its kind, “Leap of Faith” in Singapore, during your hour-long session at the indoor playground Bounce Singapore.</li>\n<li>Regardless of your age and fitness levels, enjoy the infectious atmosphere of the attraction and feel at least ten years younger!</li>\n</ul>",
