    id: "HO7385",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<p><strong>Timings:</strong></p>\n<ul>\n<li>AdventureLand is open from 10 AM - 9 PM.</li>\n<li>The last show is at 19:15 PM. </li>\n</ul>\n<p><strong>Getting there:</strong></p>\n<p>Sentosa 4D AdevntureLand is located at 51B, Imbiah Road, Sentosa 099708. You can get there by one of the following means;</p>\n<p><em>By MRT:</em> </p>\n<ul>\n<li>From Harbour Front Station, proceed to VivoCity Lobby L, Level 3. Board the Sentosa Express and alight at Imbiah Station. “Take the 3 escalators to Imbiah Lookout”.</li>\n</ul>\n<p><em>By Cable Car:</em> </p>\n<ul>\n<li>Take a scenic Cable Car ride from Mount Faber or HarbourFront Tower 2. Alight at the Singapore Cable Car Station at Imbiah Lookout, Sentosa.</li>\n</ul>\n<p><em>By Bus:</em></p>\n<ul>\n<li>Hop onto Sentosa Bus 1 or Bus 2, to alight at Imbiah Lookout Bus Stop.</li>\n</ul>",
    addressLine: "Sentosa 4D Adventureland  ",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Urban Adventures", "Virtual Reality"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<p>This one-of-a-kind 4D adventure park is a must visit when in Singapore, as this is Southeast Asia’s first 4D experience. Skip the line and immerse yourself in the three experiences that are currently screening in Adventureland:</p>\n<h2>Journey 2: The Mysterious Island- 4D Experience</h2>\n<p>This is your chance to truly live the thrilling adventures as shown the film Journey 2: The Mysterious Island. This film, starring The Rock, Dwayne Johnson was much loved across the world by kids and adults alike. Now, you can be a part of it! Participate in this awesome adventure that takes place in a Pacific Island. Feel the splash of the streams you cross, or the ground shaking as elephants pass you by. This visual treat will excite people of all ages, as you treat your senses to this technological marvel.</p>\n<h2>Extreme Log Ride</h2>\n<p>Get ready for 10 minutes of pure adrenaline overload! This ride goes through the year 2020, when humankind is on the brink of extinction, and the only way scientists have come up with to stop it from happening is by engineering a super-tree! You will be following these adventures through the Himalamazon as a supertree yourself. Put on your 4D glasses, and hold on tight, as this ride is not for the fainthearted. With incredibly real special effects, feel as if you’re actually rafting through dangerous waters, or feeling super fast winds, with state-of-the-art audio visual technologies!</p>\n<h2>Desperados: Wanted Dead or Alive</h2>\n<p>A shooting adventure set in the Wild Wild West, send your senses spinning as you take part in thrilling gunfights with bandits! This is an interactive session where you become the hero and aim your pistol at the screen and shoot the bad guys down. Before the screening begins, you will be given a motion-sensor pistol, and motion-based saddle, as you’ll be riding through rugged terrains.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "35.92",
    highlights:
      "<ul>\n<li>Enjoy access to Southeast Asia’s first four-dimensional theater experience for one whole day</li>\n<li>Equipped with digital projection and a DTS 6.1 sound system, there are several attractions to be explored</li>\n<li>Enjoy an immersive 4D movie, a 4D virtual rollercoaster, or an interactive Shoot-Out Game in 4D</li>\n</ul>",
