    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<h3>Ticket Information</h3>\n<p>This ticket has the following variants that you can choose from:</p>\n<ul>\n<li>1-Hr Pass</li>\n<li>3-Hr Pass</li>\n</ul>\n<h3>Important Information</h3>\n<ul>\n<li>A wristband will be issued upon entry with the entry timing indicated on it</li>\n<li>Re-entry into the venue is permitted. Simply show your wristband at the entrance</li>\n<li>If the stipulated timing is exceeded, a charge of SGD10 per hour will be charged at the counter </li>\n<li>Kiztopia remains closed on Tuesdays for deep cleaning</li>\n<li>Storage areas are available at the venue </li>\n<li>Vomiting, spillage, urination, other leaks, etc. may impose clean-up and sanitization charges</li>\n<li>This activity is not recommended for personals with physical mobility limitations or wheelchair users</li>\n<li>Outside food and drinks are not permitted inside the venue </li>\n</ul>\n<h3>Timings</h3>\n<p>There are 3 sessions:</p>\n<ul>\n<li>10:00 AM- 1:00 PM</li>\n<li>1:30 PM- 4:30 PM</li>\n<li>5:00 PM- 8:00 PM</li>\n</ul>",
    addressLine: "Marina Square, #01-09",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Sporting Events", "Theme Parks"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<p>Head over to Kiztopia, a fancy indoor playground at Marine Square that includes 18 themed zones, Ninja courses, AR games, bouncy castles, ball pits, and then some! Spoilt for choice, the little ones can head directly to their zone of preference. Find life-sized figures of cuddly animal friends throughout the playground and snap pictures with them. Enjoy the bouldering wall, followed by spinning poles and wobbly planks. The older children will definitely enjoy the Ninja Warrior-style obstacle course! </p>\n<p>This high-tech indoor playground offers a couple of interactive AR games that are projected onto walls. Challenge your friend to a spirited game of basketball, and be kept on your toes throughout as the basketball hoop changes positions! Whizz down the 2-story spiral slides for some typical playground-like fun. Pretend to have afternoon tea at the kitchen, or play <em>Masak Masak</em>. Awaken your inner master chef here; the food items are put together with velcro, making it easy to cut through them realistically!</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "28.80",
    highlights:
      "<ul>\n<li>Kiztopia Singapore guarantees an action-packed day for all the hyperactive tots</li>\n<li>Enjoy 18 dedicated zones that aim at improving social, emotional, and motor skills</li>\n<li>Try out the indoor driving zones, Nina obstacle courses, enormous slides, and cooking activities</li>\n<li>Partake in interactive activities with your child and seal your family bond </li>\n<li>This high-tech indoor playground also offers AR games, such as basketball </li>\n<li>Take your pick from 1-hour and 3-hour ticket options</li>\n<li>Upgrade your ticket to include an additional adult (general ticket: 1 adult + 1 child)</li>\n</ul>",
