    id: "HO9946",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<p><strong>Timings</strong></p>\n<p><em>Singapore Flyer</em></p>\n<p>Thurs - Sun (and public holidays) 3:00 PM - 9:00 PM (last admission at 8:30 PM)</p>\n<p><em>Guest Services Lounge</em></p>\n<p>Thurs - Sun (and public holidays) 2:30 PM - 9:00 PM </p>\n<p><em>Travel Trade Concierge</em> </p>\n<p>Thurs - Sun (and public holidays) 2.45 PM – 8.15 PM</p>\n<p><em>Gardens By The Bay</em> </p>\n<p>Daily from 9:00 AM - 9:00 PM (last admission at 8:30 PM)</p>\n<p><strong>Closure Dates for Gardens By The Bay</strong></p>\n<ul>\n<li>Flower Dome: 15 Jan, 12 Feb, 5 Mar, 9 Apr, 28 May, 25 Jun, 23 Jul, 27 Aug, 24 Sep, 15 Oct, 12 Nov, 10 Dec</li>\n<li>Cloud Forest: 14 Jan, 11 Feb, 4 Mar, 8 Apr, 27 May, 24 Jun, 22 Jul, 26 Aug, 23 Sep, 14 Oct, 11 Nov, 9 Dec</li>\n</ul>\n<p><strong>Reduced Price Tickets</strong></p>\n<p>Children aged 2 and below enter for free while tickets need to be purchased for children aged between 3 and 12. Please carry valid ID for children for age verification at the venue.</p>",
    addressLine: "Gelatissimo counter at Singapore Flyer",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Eco tours", "Outdoor Adventures"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>What to Expect</h2>\n<p>Gardens by the Bay is a must see while in Singapore! It is much more than a botanical garden, however, with attractions like Cloud Forest, the Flower Dome Conservatory, the various art installations around the parks, and more! Discover what plant life is like in the tropical highlands at up to 2,000 meters above sea level. Featuring a 35-meter tall mountain covered with vegetation that shrouds the world’s tallest indoor waterfall, you can take a lift up to the mountaintop, explore the one-of-a-kind biodiversity and the geology maintained here. Learn about the rare species preserved here and the environmental threats they face.</p>\n<p>Hop aboard the Singapore Flyer, the world’s second highest observation wheel, at 165 meters From inside one of the 28 air-conditioned capsules, you’ll be able to see across all of Singapore the beautiful waters surrounding it- and beyond it! Catch glimpses of Indonesia and Malaysia as well. Also see all of the most iconic landmarks of Singapore, such as Singapore River, Merlion Park and Marina Bay to Fort Canning Park, Empress Palace, Raffles Palace, Floating Stadium, etc.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "48.00",
    highlights:
      "<ul>\n<li>Enjoy skip-the-line access to the two cooled conservatories at Gardens by the Bay, the Flower Dome and Cloud Forest.</li>\n<li>Get the chance to see the world's tallest indoor man-made waterfall while you visit the park</li>\n<li>The Cloud Forest is an intricate structure, with many levels, and each with a different theme.</li>\n<li>At 165 meters above the ground, enjoy your time on the world’s second tallest Ferris wheel, the Singapore Flyer!</li>\n<li>You will enjoy stunning aerial views of not just Singapore, but of neighboring countries of Indonesia and Malaysia as well on this one rotation.</li>\n<li>Spot some of the most iconic sights of Singapore such as Singapore River, Raffles Place, Merlion Park, and Empress Place, or you can catch breathtaking sights of the ocean.</li>\n</ul>",
