    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<h3>COVID Safety Measures</h3>\n<ul>\n<li>In line with MOH, the attraction is implementing a maximum group size of 5 with a safety distance of at least 1 meter between groups and individuals <br></li>\n<li>A mandatory temperature check will be held at the entrance of the attraction. Guests who are unwell will be asked to seek medical attention immediately <br></li>\n<li>Hand sanitizers are available at the entrance and exit of the attraction. Guests are highly recommended to use them</li>\n</ul>\n<h3>Timings</h3>\n<p>Daily from 11 AM to 10 PM</p>",
