    id: "HO7394",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<p><b>Attention!</b></p>\n<p>Please be informed that In conjunction with Singapore’s National Day, the Gallery will be extending Free Admission in the month of August. All visitors can enjoy free access to all exhibitions till 31st August 2020.</p>\n<h3>Important Information</h3>\n<ul>\n<li>\n<p>As of Feb 24, 2020, in view of the evolving COVID-19 (Coronavirus Disease 2019) situation, the Gallery has implemented restricted access and temperature screening for all visitors at the following points. All visitors will also be required to complete a simple registration form.</p>\n</li>\n<li>\n<p>Coleman Entrance</p>\n</li>\n<li>City Hall Loading Bay</li>\n<li>Parliament Place</li>\n<li>Padang Atrium</li>\n<li>B2 Carpark – Lift Lobby A</li>\n<li>\n<p>B3 Carpark – Lift Lobby A</p>\n</li>\n<li>\n<p>Food and beverages are not allowed in the gallery</p>\n</li>\n<li>All facilities are wheelchair accessible</li>\n<li>Singapore Citizens and PRs can attend Permanent Galleries for free</li>\n</ul>\n<p>Visitors will not be allowed to attend the programme if they have a temperature of more than 38°C, have mild flu-like symptoms such as cough, runny nose, sore throat or fever. Visitors who are unwell should seek medical attention immediately.</p>\n<h3>Timings</h3>\n<p>The Gallery remains open from 10 am - 7 pm daily, except on the following dates:</p>\n<ul>\n<li>26 July 2020: 12:30 pm to 7 pm</li>\n<li>8 August 2020: Exhibition Galleries are closed; F&amp;B outlets remain open till 5 pm</li>\n<li>9 August 2020: 2 pm to 7 pm</li>\n</ul>\n<p><strong>Getting There</strong> </p>\n<p>By Bus: 63, 51, 80, 32, 851 stop opposite Peninsula Place, the Coleman Street entrance is a 5 minute walk away</p>\n<p>By MRT: City Hall station: Exit B, the Gallery is approximately a 7 minute walk from City Hall MRT station via the Art Connector</p>\n<p>By Taxi/Car: Entrance to the Gallery's car park is on the far right of Coleman Street; access by turning left before St. Andrew's Cathedral from the left lane of St Andrew's Road</p>",
    addressLine: "National Gallery Singapore",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Museums and Gallaries", "Shopping Experience"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<p>Situated in Singapore’s Civic District, the National Gallery of Singapore is home to the world’s largest public collection of Singapore and Southeast Asian art, which is about 8,000 works of art. Aiming to build a focus on the appreciation and acknowledgment of art across various mediums, and on Singapore’s relations with other Southeast Asian cultures, this museum opened in 2015.</p>\n<p>The gallery consists of two national monuments, the City Hall and former Supreme Court Building, both exemplary of Singapore architecture. The galleries consist of art from the 19th century to present day. Its two permanent galleries: the DBS Singapore Gallery and the UOB Southeast Asia Gallery, attempt to showcase not just the aesthetic identity of Singapore over the years, but also forms of regional interpretations and narratives through the process of their evolution. There are also some research galleries that provide space for curators and researchers to present different kinds of materials.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "11.20",
    highlights:
      "<ul>\n<li>Spend one whole day discovering exquisite Singaporean and Southeast Asian works of art.</li>\n<li>Witness the iconic Singaporean architecture.</li>\n<li>Learn about the history, culture, traditions and art of this city by immersing yourself in it.</li>\n<li>Home to over 8,000 artworks, and many exhibitions taking place here, this a must-visit in Singapore.</li>\n</ul>",
