    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>10-Second Takeaway</h2>\n<ul>\n  <li>A one-of-a-kind edutainment center aimed at engaging children</li>\n  <li>Expose your kids to an overload of science and art</li>\n  <li>Exhibits and zones designed to promote and foster parent-child bond</li>\n  <li>Hands-on activities and programs</li>\n  <li>Over 3,000 sq. m. of pioneering social ventures introducing kids to the world of adults in a mock city ambiance</li>\n</ul>\n<h2>Your Experience</h2>\n<p>KidsStop is the perfect family experience. Combining fun, innovation, interaction and knowledge, the center is aimed at pre-school to lower primary level kids and offers a platform to showcase their skill, be it creative or scientific. The exhibition gallery has 4 interactive zones designed to engage your child’s creativity and spark his thirst for knowledge while encouraging a practical, hands-on learning experience. The exhibits cover a broad range of scientific and artistic avenues ranging from the origins of Mother Earth to a futuristic world. KidsStop also offers interactive programs which foster the development of your child. There is also a whole range of fun activities including the Giant J, Dream Climber, and the Small World. Check it all out while you play and learn just like every parent’s dream and every child’s fantasy!</p>\n<h3>Timings</h3>\n<ul>\n  <li>1st session: 9:30am to 1:30pm (Last admission: 12 45pm)</li>\n  <li>2nd session: 2:00pm to 6:00pm (Last admission: 5 15pm)</li>\n</ul>\n<h2>Additional Information</h2>\n<ul>\n  <li>Your tickets are valid for 6 months from the date of purchase</li>\n  <li>Wearing of socks are compulsory for certain exhibits</li>\n  <li>Food and Drinks are not allowed within the premises</li>\n  <li>Strollers and prams won’t be allowed</li>\n  <li>Children above the age of 4 can be left unaccompanied with parents consent</li>\n</ul>",
