    id: "HO7404",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know before you go</h2>\n<h3>Ticket Information</h3>\n<p>This ticket has the following variants you can choose from:</p>\n<ul>\n<li>Stardust Cabin Menu</li>\n<li>Singapore Flavors Cabin Menu</li>\n</ul>\n<h3>Important Information</h3>\n<ul>\n<li>Singapore Cable Car (Mount Faber Line &amp; Sentosa Line) has resumed its service from 3 July, 2020. Their operating hours are from 8.45 am to 8.30 pm (last boarding at 8 pm).</li>\n<li>All sky-dining operations will cease by 8.00 pm.</li>\n<li>The cabin can only accommodate a maximum of 5 guests traveling together in a group.</li>\n<li>For your safety and in compliance with the guidelines set out by BCA (Building &amp; Construction Authority), helium balloons and any flammable items are strictly not allowed inside the cable car.</li>\n</ul>\n<h3>Timings</h3>\n<p><em>Stardust Cabin</em></p>\n<ul>\n<li>Dinner will start at 5.30 pm (last boarding at 6.30 pm) and commence for 90 mins (3 rounds) on the cable car.</li>\n<li>Diners who arrive after 6.30 pm will have their dinner duration shorten accordingly.</li>\n</ul>\n<p><em>Singapore Flavours Cabin</em></p>\n<ul>\n<li>Dinner will start at 5.30 pm (last boarding at 6.30 pm) and commence for 60 mins (2 rounds) on the cable car.</li>\n<li>Diners who arrive after 6.30 pm will have their dinner duration shorten accordingly.</li>\n</ul>\n<p><strong>General Information:</strong></p>\n<ul>\n<li>Menus are subject to changes without prior notice. </li>\n<li>The food is Pork and lard free but not halal certified. </li>\n<li>Each cabin can accommodate a maximum of 4 people and if your group consists of more than 4, then you will be split up in different cabins. </li>\n</ul>\n<p><strong>Getting there:</strong></p>\n<ul>\n<li>Faber Peak Singapore is about 7 minutes from Harbourfront Metro station. </li>\n<li>Take Exit B while coming Harbourfront station and cross the link bridge to get to the Singapore Cable car at Harbourfront tower two, where you can redeem your tickets. </li>\n</ul>\n<p><strong>Redemption:</strong></p>\n<p>You may redeem your E-ticket at the following location;</p>\n<ul>\n<li>HarbourFront Station at 3 HarbourFront Place, HarbourFront Tower 2.</li>\n</ul>",
    addressLine: "Mt. Faber Cable Car Reception",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Local sightseeing", "Outdoor Adventures"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<p>Experience the best way to savor the sights of beautiful Sentosa- take in its panoramic views from a unique vantage point as you dine with your loved ones high up in the sky! Hop into a cable car and make your way up to enjoy unparalleled views of Singapore and all its icons. Enjoy many stunning photo opportunities around the lush greenery here. With a carefully prepared meal, set against the backdrop of the glittering night sky, relax and enjoy a spectacular introduction to Singaporean cuisine. </p>\n<p>Choose between the <a href=https://cdn-imgix-open.headout.com/Menus/7404+-+Cable%2BCar%2BSky%2BDining%2B-%2BStardust%2BCabin%2BClassic%2Bmenu_TentCard.pdf>Stardust Cabin Menu</a> and the <a href=https://cdn-imgix-open.headout.com/Menus/7404+-+SGDelights_Bento.jpg>Singapore Flavors Cabin Menu</a></p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "55.20",
    highlights:
      "<ul>\n<li>An experience like no other to remember forever- dine on Singapore’s famous Cable Car on Mount Faber</li>\n<li>Dig in to a sumptuous meal, across two rounds of the cable car</li>\n<li>You can also choose the 4-course meal option, across three rounds of the cable car</li>\n<li>See stunning views of Mount Faber and Sentosa island as you enjoy your meal</li>\n</ul>",
