    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know Before You Go</h2>\n<p><strong>Timings:</strong></p>\n<ul>\n<li>The experience is open fro 10 AM to 7:30 PM</li>\n</ul>\n<p><strong>Getting there:</strong></p>\n<ul>\n<li>Board the Harbourfront MRT (NE1/CC29) and change to Sentosa Monorail, alight at Beach Station (last stop).</li>\n</ul>\n<p><strong> General Information:</strong></p>\n<ul>\n<li>Minimum requirement for a ride is 10 years old. </li>\n<li>Participants must be over 3.5 feet tall and weigh no more than 120 kg</li>\n</ul>",
