    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<p>See all the highlights of Sentosa as closely as you can- from atop a Segway! Take to these futuristic devices as you tour some of the most iconic and beautiful parts of Sentosa. See the city in its morning glory as you glide along the beaches of Siloso, Palawan and Tanjong. Also get a chance to visit some of the popular attractions such as Fort Siloso, Southernmost Point of Continental Asia, Skywalk and the Merlion. In this guided tour, your experienced and fun guide will also tell you about the history of Singapore through World War 2. As part of a small group (max 10 people), you are sure to get the best experience possible!</p>",
