        description:
          "<h2>10-second Takeaway</h2>\n<ul>\n  <li>Learn all about beer: how it's made and how it's consumed</li>\n  <li>With a professional guide, gain insights into the rich history and heritage of Singapore’s iconic beer.</li>\n  <li>Sampling session of the various brews in the Tiger Tavern</li>\n  <li>Beer connoisseur to answer any beer related questions</li>\n</ul>\n<h2>Your Experience</h2>\n<p>Your beer tour starts off at the Visitor Centre at the Singapore Tiger Brewery where you’ll learn all about the iconic beverage. Discover the ingredients used in different brews and the intricate details considered while brewing a glass of your favorite drink. Smell the strong aroma of malt and learn about the brewing process at the Brew House.</p>\n<p>Once done, learn the art of pouring a perfect glass of draught beer. Enjoy a glass of the freshest Tiger Beer along with other brews during the beer sampling at the Tiger Tavern. Be sure to ask the guide any question you might have regarding any part of the process.</p>\n<h2>Additional Information</h2>\n<ul>\n  <li>The experience is for individuals who are 18 and above</li>\n  <li>Your ticket is valid for 6 months from the date of purchase</li>\n  <li>Guided tours happen every 1 hour starting from 1 PM until 5 PM. You are requested to arrive 10 minutes before the start of the tour</li>\n</ul>",
