    description:
      "<h2>10-second Takeaway</h2>\n<ul>\n<li>360-degree all-around view from one of Singapore’s tallest buildings.</li>\n<li>View 19 famous historical landmarks from a bird’s eye view.</li>\n<li>Have a drink on the 63rd floor, the world’s highest alfresco bar, while enjoying the breathtaking surroundings</li>\n</ul>\n<h2>Your Experience</h2>\n<p>The 1-Altitude Gallery is 262 meters from ground level and among the highest view points in Singapore. Get on the 63rd floor of the One Raffles Places and take in the surreal view from a godly perspective. Spot up to 19 historical landmarks and more than 1000 buildings from your seat in heaven! </p>\n<p>While seated, be sure to have a drink at the world’s highest alfresco bar. Don’t worry, you’re already here! Be sure to take pictures of your memorable experience. </p>\n<h2>Additional Information</h2>\n<ul>\n<li>Price of drink is included in the ticket price. </li>\n<li>Attraction closes at 5:30pm.</li>\n<li>Free Entry for kids aged 7 and below.</li>\n<li>Voucher is valid for 1 month from date selected when booking</li>\n<li>Redeem your tickets at Level 1 - Ticketing Office</li>\n</ul>",
