    id: "HO7674",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "\n<h2>Know  Before You Go</h2>\n<p><strong>Accessible Areas:</strong></p>\n<p>Your tickets include access to garden areas, the Cloud Forest, the Flower Dome, the Supertree Grove and the OCBC Skywalk which connects the Supertrees. </p>\n<p><strong>Child Entry:</strong></p>\n<p>Entry for children below the age of 2 is free. </p>\n<p><strong>Timings:</strong> </p>\n<p><strong><em>OCBC SKYWALK Timings</em></strong> </p>\n<p>Please note that due to the heavy volumes at the OCBC Skywalk during the winter season, entry tickets to the Skywalk will be timed entry tickets, with time slots starting from 6 PM (or later depending on the crowds) in the evening at 20-minute intervals. The last time slot to be issued and the last ticket sale will be 8 PM with 9 PM being closing time. You <em>must</em> approach the Admissions Staff on the ground for the Skywalk and obtain tickets for the next available time slot and return for entry at that designated time. </p>\n<p><strong>Cable Car Timings</strong></p>\n<p>The experience is open from 8:45 AM to 10 PM.\nThe last boarding will be at 9:30 PM.</p>\n<p><strong>Cable Car Boarding Points</strong></p>\n<p>Cable Car Station at Mount Faber. 109 Mount Faber Road.\nHarbourFront Station at 3 HarbourFront Place, HarbourFront Tower 2.</p>\n<p><em>OR</em></p>\n<p>Merlion Station at 2 Siloso Road 098973, Sentosa.</p>\n<p><em>Getting There</em></p>\n<p>Faber Peak Singapore is about 7 minutes from Harbourfront Metro station.\nTake Exit B while coming Harbourfront station and cross the link bridge to get to the Singapore Cable car at Harbourfront tower two, where you can redeem your tickets.</p>",
    addressLine: "1 Bayfront Ave, Singapore 018956",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["City Pass", "Eco tours"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: null,
    currency: "SGD",
    description:
      "<h2>Your Experience</h2>\n<p>This is a truly stunning location that must not be missed while in Singapore! It was originally a nature reserve park, a strategy by the government to convert the city from a “Garden City” to a “City In A Garden”.</p>\n<h3>Pro Tip</h3>\n<p>We highly suggest that you visit the Gardens in the late afternoon when the weather is a little more forgiving so you can walk through the gardens at a relaxed pace. This has the added benefit of allowing you to watch the nightly Garden Rhapsody music and light show that takes place at the Supertree Grove at 7:45 PM and 8:45 PM.  </p>\n<h3>Gardens By The Bay</h3>\n<p>The Cloud Forest showcases plant life in the tropical highlands.Featuring a 35-meter tall mountain covered with vegetation, that shrouds the world’s tallest indoor waterfall! You can take a lift up to the mountaintop, explore the one-of-a-kind biodiversity and the geology maintained here. At the Flower Dome, you can enjoy a lovely walk in the temperature controlled dome, as you marvel at the changing display of plants and flowers from Mediterranean regions. Learn about how the flora of these regions have adapted to the cool-dry climates of areas like South Africa, California, and parts of Spain and Italy. </p>\n<p>Witness a truly unique sight of vertical gardens, at the Supertree Groove, measuring between 25-50 meters, designed with large canopies that provide respite from the sun in the day, and at night come alive in a stunning light and sound show!</p>\n<p>You also get one-way shuttle service from Marina Square Shopping Mall. Shuttle timings are from 10:45 - 16:45 with a shuttle departing each hour.</p>\n<h3>OCBC Skywalk</h3>\n<p>The picture perfect location at Gardens by the Bay, the OCBC Skyway is a must-visit location in Singapore. At 22 meters above ground, this 128-meter long walkway presents one-of-a-kind scenic views of the city and allows you to capture the surrounding flora in all its splendor. </p>\n<p>Walk on the skywalk and take in the sights on the majestic Supertree Groove and see the colors light up on this memorable walk.</p>\n<h3>Enjoy Singapore's Skyline with an Optional Cable Car Ride</h3>\n<p>Witness the city of Singapore come to life at discounted prices on an unforgettable cable car ride. Skip the line and take to the skies to enjoy unparalleled views of Singapore and all its icons. With the round-trip pass, you can complete the entire trip irrespective of the station you start at.</p>\n<p>The spacious cabins are wheelchair friendly and can accommodate strollers too. You can also visit Mount Faber Park, one of Singapore’s oldest hilltop parks. Enjoy many stunning photo opportunities around the lush greenery here. Cross through a skyscraper and go across the harbor to reach Mount Faber. On the Sentosa Line, fly over the jungle, sand, and sea and see the many attractions from a unique vantage point.</p>",
    dropoff: false,
    exclusions: "",
    fromPrice: "24.00",
    highlights:
      '<ul>\n<li>Explore the Gardens by the Bay, a surreal urban oasis, at your own pace </li>\n<li>Enjoy access to the two cooled conservatories, Flower Dome and Cloud Forest</li>\n<li>Take in panoramic views of Singapore and Gardens by the Bay at the OCBC Skywalk</li>\n<li>Stroll 22 meters above the ground and get up close to the supertrees.</li>\n<li>Get the chance to gain entry at discounted rates to Marina Bay Sands Sky along with Gardens by the Bay and it\'s OCBC Skywalk by clicking <a href="https://www.headout.com/tour/7570/singapore/singapore/skip-the-line-access-to-marina-bay-sands-and-gardens-by-the-bay-with-ocbcskywalk">here.</a></li>\n<li>Witness the Singapore skyline come to life on an optional cable car ride at 30% off with this product.</li>\n</ul>',
