          "<h3>Please be informed that effective 1st January 2019, all customers are compulsory to wear Angry Bird's sock. This is to keep customer's hygien and safety</h3>\r\n<p>Located right in the heart of Komtar JBCC,&nbsp; you might want to add an afternoon at Angry Birds Activity Park to your itinerary while making a day trip across the Causeway with your family.&nbsp; &nbsp;Don&rsquo;t be deceived by the colourful 26 000 square foot facade. Inside, you can find attractions that are suitable for kids of all ages. Laze by the Parents Lounge for a quick snack while waiting for your children or get sweaty with them at popular stations like the Anti Gravity Trampoline and the Giant Leap Foam Pit. Kids can also scoot around safely at the Go! Kart Track and scale through an indoor obstacle course at the Bird Nest Climbing Track. Do remember to bring a pair of socks along.</p>\r\n<p>Multiple entry is allowed.</p>\r\n<p>From Monday &ndash; Thursday, tickets are valid from time of entry until 10pm.</p>\r\n<p>From Friday &ndash; Sunday, public holidays / school holidays or peak days, the operational hours will be divided into 3 sessions. However, the tickets are valid from time of entry until 10pm.</p>\r\n<p>Sessions are fixed as follows: Session 1: 10am - 1pm | Session 2: 2pm - 5pm | Session 3: 6pm - 10pm.</p>",
        termsAndConditions:
          "<p>1. PRINT THIS TICKET &ndash; This is your proof of purchase and is your ticket for admission.</p>\r\n<p>2. SCAN THIS TICKET AT THE TURNSTILE &ndash; This is your ticket for entry into Angry Birds Activity Park.</p>\r\n<p>Guest with special Needs</p>\r\n<p>Most of the games and attractions in the park are accessible to all guests, including the disabled. For special assistance, please do not hesitate to contact any of our Flock Members.</p>\r\n<p>Shoe Cabinets &amp; Locker Rental</p>\r\n<p>No shoes are allowed in the park. Shoe cabinets are provided for free while electronic safety lockers are available for rent.</p>\r\n<p>Baby Care Facilities</p>\r\n<p>Baby Care Centres are located in the mall.</p>\r\n<p>Wheelchairs</p>\r\n<p>Complimentary wheelchairs are available upon request at the Front Desk on a first-come, first served basis. No other personal wheeled vehicles are allowed in the park.</p>\r\n<p>Socks</p>\r\n<p>Please be informed that you are require to wear socks in our park at all time. You may bring your own socks or purchase it from our ticketing counter.</p>\r\n<p>&bull; Lost or stolen tickets will not be replaced.</p>\r\n<p>&bull; Security wristbands are non-transferable.</p>\r\n<p>&bull; Temporary exits are allowed but are limited by their validity.</p>\r\n<p>&bull; The Management reserves the right to close down certain games and attractions for maintenance, remodeling and/or private events without prior notice.</p>\r\n<p>&bull; Please be advised that age and/or physical restrictions may apply to certain games and attractions. Kindly refer to the information board posted at the entrance for more details.</p>\r\n<p>&bull; No outside food and beverages are allowed in ANGRY BIRDS ACTIVITY PARK JOHOR BAHRU.</p>\r\n<p>&bull; Chewing gum, smoking and the use of drugs/alcohol is strictly prohibited in ANGRY BIRDS ACTIVITY PARK JOHOR BAHRU.</p>\r\n<p>&bull; Commercial photography, filming and journalistic coverage is strictly prohibited. All media and coverage requests should be directed to the ANGRY BIRDS ACTIVITY PARK JOHOR BAHRU Customer Service Counter no less than 7 days prior to the intended date of coverage.</p>\r\n<p>&bull; Unauthorized business transactions or commercial activities shall be prohibited within the premises of ANGRY BIRDS ACTIVITY PARK JOHOR BAHRU.</p>\r\n<p>&bull; All visitors to ANGRY BIRDS ACTIVITY PARK JOHOR BAHRU are expected to behave in an orderly, respectful and safe manner at all times.</p>\r\n<p>&bull; The Management and Flock Members of ANGRY BIRDS ACTIVITY PARK JOHOR BAHRU reserve the right to refuse entry or expel from the premises anyone who fails to comply with these Rules &amp; Regulations or the park's Terms and Conditions made available in www.angrybirdsactivitypark.my</p>\r\n<p>Kindly refer to our Customer Service representatives for further information.</p>",
