        name:
          "Mega Adventure (ZIP CLIMB JUMP) Adult/Child valid til MaR 31, 2022",
        description:
          "<p>Mega Adventure Park - Singapore is located on the picturesque Sentosa Island, host to Singapore&rsquo;s main attractions. Mega Adventure operate the world famous MegaZip flying fox</p>\r\n<p>MEGAZIP</p>\r\n<p>MEGACLIMB</p>\r\n<p>MEGAJUMP</p>",
        termsAndConditions:
          "<p>MEGA ADVENTURE (ZIP CLIMB JUMP)</p>\r\n<p>Address: 10A Siloso Beach Walk Singapore 099008</p>\r\n<p>Hours: 10am to 6pm</p>\r\n<p>MegaZip combines adrenaline, speed aand fun to let you fly like an eagle! At 75 metres high, 450 metres long and heart pounding speed of 60kph, MegaZip is the first 3 wire zip line built to test friendships as you race your mates or family in an exhilarating, breathtaking adventure from the jungle canopy of Imbiah Hill to the white sands of Siloso Beach finish point.</p>\r\n<p>Height &amp; Weight:</p>\r\n<p>Min Height &ndash; 90cm</p>\r\n<p>Min Weight &ndash; 30kg unaccompanied</p>\r\n<p>Max Weight 140kg</p>\r\n<p>Last entry: 5.30pm</p>\r\n<p>MegaClimb is Singapore&rsquo;s premiere high ropes adventure course 5 to 15m high eucalyptus trees create a formidable course in the jungle hilltops of Sentosa.</p>\r\n<p>Height &amp; Weight:</p>\r\n<p>Min Height &ndash; 120cm</p>\r\n<p>Min Weight &ndash; 25kg</p>\r\n<p>Max Weight &ndash; 120kg</p>\r\n<p>Last Entry: 5.30pm</p>\r\n<p>MegaJump &ndash; leap point, the views are amazing, ocean, Jungle, palms swaying in the breeze. White sandy beachers and a 15 metre drop to the onlookers below. A custom made safety wire and harness developed in the UK and controlled with clockdwork efficiency by our experienced staff is a first for Singaore and allows you to replicat a free fall parachute jump &ndash; without the plane ride.</p>\r\n<p>Weight Requirement:</p>\r\n<p>Min &ndash; 30kg</p>\r\n<p>Max &ndash; 120kg</p>\r\n<p>Last entry: 5.30pm</p>\r\n<p>Please note that all guests must be able to fit into our harnesses to participate in our activities</p>",
