    description:
      "Take a bite out of The Big Apple as you pass all the classic landmarks of New York or find yourself in The Lost World where dinosaurs lurk round every corner. Step through a portal into another world in Sci-Fi City and pick your side in the battle between good and evil before taking a stroll down the walk of fame on Hollywood Boulevard. Befriend ogres and princesses in the Shrek-themed Far Far Away zone or chill out with lions, hippos and zebras in Madagascar. Or perhaps indulge in a spot of time travel and transport yourself back to the golden age of Egyptian exploration, excavating pharaoh’s tombs and revealing the wonders and curses found within.<br />\n<br />\nDeceive your senses in the illusionary Trick Eye Museum and meet the denizens of the deep at the world’s largest oceanarium. With over 60 restaurants ranging from Asian cuisine to classic American fare you’re bound to find something to satisfy your cravings.<br />\n<br />\nOn Saturdays and Sundays you can experience the Hollywood Dreams Parade and watch your favourite characters brought to life right in front of you and every Saturday the night is rounded off with the dazzling Lake Hollywood fireworks spectacular.",
