    createdOn: "Thu Feb 04 2021 20:38:44 GMT+0000 (Coordinated Universal Time)",
    currency: "SGD",
    description:
      "Discover the sights of Singapore onboard an open-top bus with Big Bus Tours ticket. Explore the city across 6 routes and enjoy views of the city’s most famous landmarks.<br />\n<br />\nSee the iconic Gardens by the Bay, Marina Bay Sands, and the UNESCO-inscribed Botanic Gardens on the Yellow Route, or explore the 3 ethnic precincts of Singapore – Chinatown, Little India, and Kampung Glam (the Arab enclave) – on the Red Route. If you want to experience the diverse cultures and the uniquely vibrant streets of Singapore in one glance, the Blue Route will take you through the quaint historical sights blended in to the modern architectural landscape of Singapore.<br />\n<br />\nVisit the island of Sentosa on the Green Route, and spend the day on the beach or at the many attractions available there. You can also take a ride to the wild side on the 2 Safari shuttle lines to the Zoo, River Safari, Night Safari, and the Bird Park.<br />\n<br />\nWhat's more, enjoy complimentary 1-way transfer (from 47 city bus stops) to the meeting point where the tour begins.<br />\n<br />\nChoose a <strong>1-day Classic Ticket</strong> and hop-off at any stop to explore Singapore your way. Valid on all 6 routes<br />\n<br />\nPick a <strong>2-day Premium Ticket</strong> for another day on the bus plus 2 Walking Tours at Chinatown and Little India. Valid on all 6 routes<br />\n• <strong>Walking Tours </strong><br />\nGuests are to check-in 15 minutes prior to tour timing.<br />\n1) Chinatown Walking Tour<br />\nPagoda Street, Tourist Information Kiosk, next to Sri Mariamman Temple<br />\nMon, Wed, Fri, Sun 10:30am<br />\n<br />\n2) Little India Walking Tour<br />\n5 Campbell Lane, outside Indian Heritage Centre<br />\nTue, Thu, Sat 10:30am<br />\n<br />\nOr go for a <strong>2-day Deluxe Ticket </strong>that comes with 2 Walking Tours and a 3-hours guided Night City Tour. Valid on all 6 routes<br />\n• <strong>Night City Tour</strong><br />\nGuests are to check-in 30 minutes prior to tour timing.<br />\nDaily, 6:30pm<br />\nFrom 3 Temasek Boulevard, Suntec Shopping Mall, #01-330 Singapore 038983<br />\n<br />\n<strong>Departure time - Shuttle Lines</strong><br />\nGreen Line – 10:00am to 6:30pm (every 40minutes)<br />\nSafari Line 1 – 8:30am, 9:30am, 10:30am, 11,30am, 12:30pm, 2pm, 3pm, 4pm, 6pm, 6:30pm, 7pm<br />\nSafari Line 2 – 9:30am, 11:30am, 2:00pm<br />\n<br />\n<strong>Itinerary - Shuttle Lines<br />\nGreen Line (Shuttle Service)</strong><br />\n• Singapore Flyer<br />\n• Marina Bay Sands<br />\n• Resorts World Sentosa<br />\n• Sentosa Island<br />\n<strong>Safari Line 1 (Shuttle Service)</strong><br />\n• Singapore Zoo<br />\n• River Safari<br />\n• Night Safari<br />\n<strong>Safari Line 2 (Shuttle Service)</strong><br />\n• Jurong Bird Park<br />\n<br />\n<strong>Languages</strong><br />\nAudioguide available in English, Mandarin, Bahasa Indonesia, Korean, Japanese, Vietnamese, Russian, German, French, Spanish, Italian, and a kids channel.",
