    supplierId: "12",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "<strong>Enjoy a fun and refreshing day out at Adventure Cove Waterpark, perfect for all your family and friends. Zoom down the fast and thrilling slides, leisurely float round the Adventure River or swim with exotic fishes, this park really has it all!</strong>",
    addressLine: "",
    allPassengerDetailsRequired: true,
