    createdOn: "Thu Feb 04 2021 20:38:45 GMT+0000 (Coordinated Universal Time)",
    currency: "SGD",
    description:
      "Dare yourself to go on the thrilling water slides such as the Pipeline Plunge, with sharp drops and radical, fast-paced twists topped off by being dunked into the pool. This really gets your adrenaline rushing. Why not race your mates on the dueling racer, where you can rocket down side by side? Let the best man win! Choose from many other rides including Riptide Rocket, Spiral Washout and Tidal Twister, the excitement never ends.<br />\n<br />\nIf you want to relax, grab a rubber ring and head to the Adventure River. Leisurely ride around the circuit whilst drifting past 14 stunning surroundings such as a jungle garden, a grotto and an underwater sea tunnel where marine life literally swims around you.<br />\n<br />\nExplore the Rainbow Reef, where you can swim amongst over 20,000 friendly fish in a beautiful man-made reef. Then head over to the Ray Vay where you’ll come up and close to this fascinating creature. Touch their velvety bodies as they gracefully swim past.<br />\n<br />\nFor the younger adventurers, there is a shallow play pool including fountains and activities perfect for toddlers. If you get a bit hungry from all the excitement, head over to the Bay Restaurant that offers a fine selection of Asian and Western delights.<br />\n<br />\n ",
