    type: "attractionsList",
    active: false,
    additionalInfo:
      "<strong>A whole day of enjoyment at two of Singapore’s natural attractions: Singapore Zoo and River Safari. At the Singapore Zoo, animals roam freely in open and natural habitats separated from visitors by streams, rock walls and beautiful landscaping. Whether you explore by tram or on foot, your visit to the Zoo will be one of close encounters.</strong>",
