    currency: "SGD",
    description:
      "Whether you explore by tram or on foot, your visit to the Zoo will be one of close encounters through feeding sessions of different animals or intimate encounters at its walk-through exhibits. Catch playful, gentle giants frolicking at the Elephants at Work and Play Show and stick around for the token feeding session where you will be up close to these gentle giants. You will have some free time on your own for lunch before the River Safari Tour.<br />\n<br />\nContinue your wildlife adventure at the iconic River Safari. Explore more than eight habitats at Asia’s only river-themed wildlife park and don’t miss out meeting Jia Jia and Kai Kai at the Giant Panda Forest. Stroll through Squirrel Monkey Forest and stop by the Flooded Amazon Forest to catch glimpses of the unique and amazing life that thrives in these rivers.",
