    supplierId: "12",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "<strong>Embark on an adventure through the world’s very first night safari, a stunning imitation of a variety of natural habitats in the heart of Singapore. Observe fearsome predators alongside other jungle critters under the night’s mysterious veil. Join the ride and plunge yourself deep into the wild!</strong><br />\n ",
    addressLine: "",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Bars & Nightlife", "Nature and Wildlife"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: "Thu Feb 04 2021 20:38:45 GMT+0000 (Coordinated Universal Time)",
    currency: "SGD",
    description:
      "Learn about the most interesting facts and did-you-knows about the safari as you become aquainted with your guide before hopping onto the tram. Alongside your guide, delve into the mysterious night as you explore the 40 hectares of secondary jungle. Admire how the tropical jungle unleashes a new life at dusk.<br />\n<br />\nSingapore’s Night Safari contains a myriad of nocturnal critters, from the fierce predators to the smaller timid animals. Spot every one of them under the magical moonlight thanks to your guide’s well-trained eye. Your comfortable tram will transport you absolute safety through the park’s East and West Loop.<br />\n<br />\nAlong the way, you will pass by a large reservoir and weave in and out and around a selection of natural habitat replicas. The spaces are so well taken care of you’ll easily forget you’re in Singapore and might think yourself deep in the Asian jungle. Some of the imitation environments you’ll roll through include the Himalayan foothills, the Southeast Asia rainforests and the Indian subcontinent.<br />\n<br />\nAfter finishing the ride, your guide will take you along a walking trail where you will see some of the animals upclose. You are in for a wild night!",
