    currency: "SGD",
    description:
      "Embark on a journey of discovery at River Safari, Asia’s first and only river-themed wildlife park, and come face-to-face with over 5,000 aquatic and terrestrial animals belonging to some 300 species. Must-see highlights include a pair of resident giant pandas and a recreation of the Amazonian rainforest submerged in floodwater.<br />\n<br />\nOccupying over 12 hectares of land, River Safari recreates eight freshwater ecosystems from around the world including the Nile, the Yangtze, the Mississippi, the Congo and the Ganges. Here you will encounter a host of species, many endangered in the wild, such as anacondas, electric eels, Mekong freshwater stingrays, giant catfish and Chinese alligators. Stroll through freshwater galleries and enter walk-through exhibits to learn about the fascinating flora and fauna of river habitats. With ‘Express Access’, you won’t have to wait in line to catch giant pandas Kai Kai and Jia Jia in the 1,500 square-metre Giant Panda Forest, the largest panda exhibit in Southeast Asia. Also sharing this climate-controlled biodome are the rare red pandas and elegant golden pheasants. Check out the Amazon Flooded Forest exhibit which, with its 2,000 cubic metres of water, boasts of being the largest freshwater aquarium in the world, while the Frozen Tundra exhibit simulates an Arctic habitat and is home to Inuka, a polar bear.<br />\n<br />\nThe river is calling … begin your journey of discovery at River Safari today. You will probably never look at rivers in quite the same way again.<br />\n<br />\n<strong>Languages</strong><br />\nEnglish",
