    currency: "SGD",
    description:
      "Venture into the wild on this Safari double whammy. Join us to explore both Singapore’s River Safari and the Night Safari – the very first Night Safari in the world! Forget the notion that Singapore is all high-tech, skyscrapers and metropolitan city life; on these safaris you will feel as if in the midst of an Asian rainforest.<br />\n<br />\nThroughout the duration of the tour, you will at all times be accompanied by an enthusiastic guide who will tell you all the jungle facts and tales. To begin, the River Safari takes you through one of the world’s single largest repositories for river critters. On this trip you will encounter all sorts of creatures: large and small; mammal, reptile and amphibian; water dwellers and land dwellers…; all of this amidst splendorous imitations of some of the world’s most famous rivers.<br />\n<br />\nLater on, when darkness falls, the time has arrived to hit the Night Safari. While riding a comfortable Tram, spot some magnificent nocturnal animals in their natural habitat. Fearsome predators and humble herbivores coexist side by side under the glassy glow of the moon. Do not worry about losing track of them or not spotting any in the dark: your well-trained guide can point out all the creatures in the surroundings.<br />\n<br />\nAs you return to the city to hit the sack, you will feel as if you are stepping out of a dream. It is amazing how jungle environments can exist so near a thriving metropolis like Singapore.<br />\n<br />\n<strong>Languages</strong><br />\nEnglish.",
