    additionalInfo:
      "<strong>Immerse yourself in what is consistently rated as one of the top zoos in the world. With over 2,500 animals belonging to 300 distinct species, many of which are threatened in the wild, living in naturalistic, open settings and separated from the public only by moats or glass it is easy to see why Singapore Zoo retains its enduring popularity, receiving over 1.6 million visitors every year.</strong>",
