    currency: "SGD",
    description:
      "Singapore Zoo is spread over 28 hectares and is a haven to a host of mammals, birds and reptiles including many rare and endangered species. Natural barriers like streams, rock walls and beautiful landscaping are used to separate the animals from visitors thus creating an ‘open zoo’ effect. Marvel at the rare white tigers and thrill at the largest captive colony of orang-utans in the world.<br />\n<br />\nAmong the varied shows and attractions, you can choose from ‘Breakfast with an Orang-utan’, which allows visitors to interact with this fascinating and highly intelligent member of the ape family; ‘Elephants at Work and Play’, which demonstrates how elephants have been used as beasts of burden in south-east Asian countries; and ‘Splash Safari’, which showcases the zoo’s aquatic mammals and birds. For younger visitors there’s Rainforest Kidzworld, where they can splash around in a watery playground, spend time with farmyard animals and take a rainforest challenge.<br />\n<br />\nA morning of fun for all the family awaits you at the endlessly surprising Singapore Zoo.",
