    supplierId: "12",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "<strong>Come along and build your own dream, brick by brick. Board the bus that takes you all the way back to your childhood and allow your children to live theirs to the full at Legoland Malaysia - a theme park with a difference.</strong>",
    addressLine: "",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Theme Parks", "Urban Adventures"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: "Thu Feb 04 2021 20:38:46 GMT+0000 (Coordinated Universal Time)",
    currency: "SGD",
    description:
      "Explore this fantasy land block by block, admiring the sensational scale recreations of emblematic places and then enjoy the rip-roaring thrills of the more than 70 rides, slides, shows and attraction in the fun park, including three roller-coasters and a water park.<br />\n<br />\nThere is something for all ages in each of the seven themed areas. At Miniland, discover a miniature world in Lego form, depicting towns and cities from all over Asia, using millions and millions of Lego bricks to recreate iconic buildings such as the Taj Mahal and the Petronas Towers. And you can catch the latest Miniland attraction at Chima, an action-packed world formed by detailed reconstructions of mystical landmarks.<br />\n<br />\nAt Imagination, creativity knows no bounds and inventors big and small can bring their imaginings to life, while young children will marvel at the life-size Duplo Express, a small train located in the Duplo Playtown area.<br />\n<br />\nOver in Lego City, the children take the controls and learn safety in a fun environment. Watch them play away at the Airport, the Boating School, the Shipyard and the Rescue Academy. Then make a splash at Legoland Water Park, where more than 20 slides and 70 Lego models are to be found. What’s keeping you? Come along and build your own dream, brick by brick, at Legoland Malaysia.<br />\n<br />\n<strong>Drop-off time</strong><br />\nAt 6pm",
