    id: "HBE-SG1-SG-SGHOHP",
    supplierId: "12",
    type: "attractionsList",
    active: false,
    additionalInfo:
      "<strong>There is no better way to see Singapore than on board the City Sightseeing open-top bus, where you can hop-on and hop-off and tour at your own leisurely pace. The system connects you from hotel to sights and attractions, saving your transportation cost and time.</strong>",
    addressLine: "3 Temasek Boulevard, Singapur",
    allPassengerDetailsRequired: true,
    askSpecialRequirements: true,
    category: ["Bus Ticket", "City Pass"],
    city: "Singapore",
    contentApproved: false,
    country: "Singapore",
    createdOn: "Thu Feb 04 2021 20:38:46 GMT+0000 (Coordinated Universal Time)",
    currency: "SGD",
    description:
      "It is easy to enjoy Singapore with the City Sightseeing open-top touring system. The hop-on and hop-off system allows you to tour at your own leisure. Spot an interesting place or sight? Simply hop off and walk around and you can continue the tour later by hopping on the next bus. With a bus arriving every 15 to 20 minutes, the City Sightseeing system links you to major sights, attractions and hotels which doubles as a transportation system and makes it easy and convenient for you to move around!<br />\n<br />\nChoose your own pace on how you want to sight-see-experience and explore this tour: from 24 or 48 hour ticket validation pass and stay aboard for the entire loop of each route, or hop on and off at any of the stops that interest you.<br />\n<br />\nHop on the Yellow Line to see the unmissable Marina Bay Sands. Hop off here and see one of the most incredible complex buildings in the world, which has the longest elevated swimming pool with rooftop restaurants, nightclubs and gardens. If you're feeling peckish, hop off at the Zion Food Centre - where you can discover the delicious taste of traditional local dishes. The route then passes the beautiful Botanical gardens, and both the Orchard and Marriott Hotels. The bus passes Orchard Plaza, Rendezvous Hotel and the Art Museum before heading back to Suntec City.<br />\n<br />\nOn the Red Route you can see even more sights, such as Little India, Boat Quay, Chinatown and Hong Lim Park. Don´t delay, book your ticket today!<br />\n<br />\n<strong>Start/opening time</strong><br />\nYellow Route at 8:30am.<br />\nRed Route 9:40am.<br />\n<br />\n<strong>End/closing time</strong><br />\nAt 6:30pm.<br />\n<br />\n<strong>Frequency</strong><br />\n20-25 minutes.<br />\n<br />\n<strong>Languages</strong><br />\nAudio guides in English, Spanish, German, Italian, French, Chinese, Japanese, Russian, Korean, Vietnamese, Bahasa Indonesia and kids commentary.",
    dropoff: false,
    exclusions: "<div></div>",
    fromPrice: "40.60",
    highlights:
      "Create your own itinerary and see the city at your own paceLearn about the fascinating city of Singapore with an audioguide available in 12 languagesChoose from 2 routes with over 30 route stops!",
