    description:
      "We want you to have a fun, relaxing time in Singapore without the stress of not knowing your way around. Enjoy a fun day out with your own private english speaking driver and transport. With this unique charter you will have the liberty to go wherever you want to go and see whatever you want to see. You can plan your own touristic route, visiting the busy city or exploring the Singapore city. There are many ways to explore Singapore but one of the most comfortable and interesting ways is surely on this tour with a private car charter. This service is a free program using a private air conditioned car, a friendly English speaking driver and the possibility to go wherever you want to go. Sit back and enjoy the ride and when something catches your eye feel free to stop and wander around. This is how you will see Singapore with a personalized route. What do you want to do? On this excursion the experienced driver will show you the culture, beauty and traditions of this wonderful Country. Furthermore you can discuss with the driver which itinerary you would like to have depending on your mood and interests. The list goes on and you have the freedom to choose whatever you feel like doing. This definitely is the best way to see Singapore, there is no better way to travel.",
