    description:
      "1-Altitude Gallery stands at the peak of 292 metres and boasts a sppectacular 360-degree view. Located at the top of 1-Altitude, a multi-concept lifestyle destination in Singapore that stretches across the 61st to the 63rd floor of One Raffles Places, 1-Altitude Gallery promises to bring a new definition to living on the edge, literally.Standing at the tallest point of Singapore, the Upper Viewing Gallery offers a stunning view of Singapore's cityscape.<br />\n<br />\nThe breath-taking sight will redefine Singapore in your perspective. It is the ideal place to escape from the bustling, fast-paced crowd on the grounds for a quiet and yet exciting moment in the skies. The expansive skyline of Singapore is a perfect backdrop for your photo moment as well. The triangular shape of the Gallery allows visitors the rare opportunity to have bird`s eye view of the 20 significant landmarks situated in all directions on the island, complete with their historical background.",
