    description:
      "MegaZipMegaZip combines adrenaline, speed and fun to let you fly liike an eagle! At 75 metres high, 450 metres long and heart pounding speeds of 60kph, MegaZip is the first 3-wire zip line built to test friendships as you race your mates or family in an exhilarating, breathtaking adventure from the jungle canopy of Imbiah Hill to the white sands of Siloso Beach finish point.MegaJumpAt the MegaJump leap point, the views are amazing. Mega Adventure aims to replicate a free-fall parachute jump - without the plane ride.<br />\n<br />\nA thrilling 15-metre drop to the onlookers below is sure to give you the adrenaline fix you need! Clockwork efficiency by our experienced staff and a custom-made safety wire and harness developed in the UK makes this a first for Singapore. MegaClimb MegaClimb is Singapore's premier high ropes adventure course. 5 - 15 metres high trees create a formidable course in the jungle hilltops of Sentosa. The views are breathtaking, the thrills are endless and the well-trained staff ensure that the experience is safe, efficient and highly addictive. The perfect environment to challenge yourself or your team.",
