    description:
      "Explore Singapore’s latest garden attraction - Gardens by the Bay!GGardens by the Bay is an urban oasis in the midst of the bustling city centre. Featuring a picturesque collection of outdoor gardens and lakes, the Gardens also include the signature Flower Dome and Cloud Forest cooled conservatories as well as the landmark Supertrees that capture imagination and inspire awe.Flower DomeStep into Flower Dome, a cooled conservatory displaying exotic plants from the Mediterranean belt.<br />\n<br />\nImmerse yourself in the spectacular view of the Marina reservoir skyline, as you embark on your journey through the regionally themed gardens that highlight unique locales from the Mediterranean Basin, South West Australia, South Africa, Central Chile, and California. Embark on a botanical journey with plants like the Baobab trees, the Madagascar Ghost Tree, and the 1000-year-old Olive tree. With an abundance of colours and fragrances, this Garden gloriously displays the theme of ‘perpetual spring’ with the Flower Field, a botanical display of vibrant plants and blooms. Cloud ForestEnter another world as you step into the aptly named Cloud Forest, a mysterious world veiled in mist.<br />\n<br />\nWith a 35-metre tall mountain covered in lush vegetation shrouding one of the world’s tallest indoor waterfalls, the Cloud Forest showcases plant life from the wet and cool highlands around the world.It has been densely planted with a mixture of fascinating orchids, delicate ferns, colourful bromeliads, dazzling begonias and carnivorous pitcher plants. Enjoy the surreal Cloud Walk as you stroll through the treetops and down into the caverns and valleys of a tropical montane while you learn about the close relationships between plants, man, and the environment.",
