    currency: "SGD",
    description:
      "Embark on a day trip discovering the heritage and culture of Johore Bahru, the southernmost city of Peninsular Malaysia. Travel across the border with your friends or family in the comfort of your own air-conditioned vehicle to explore this city, which was once a cozy little fishing village that has now grown into a modern metropolis.<br />\n<br />\nBe intrigued by the architectural design of Abu Bakar Mosque, built in the style of English Victorian architecture resembling the British 19th century clock towers.<br />\n<br />\nImmerse in the sights and sounds as you walk through the streets of Tan Hiok Nee Heritage Street. Our guide will relate the tales of the early Chinese immigrants and you also get to savour some local delights recommended by our tour guide.<br />\n<br />\nThe visitors of our guided tours will have access to the State Legislative Assembly Building during your tour of Kota Iskandar, Johore State Administrative Centre. Inspired by Moorish-Andalusian and Malay designs and motifs, this is Malaysia's first Experiental Parliament where you would have an insider's look of this magnificent Johore's State Parliament Hall (Non Parliament seating days).<br />\n<br />\nAll this walking will work up your appetite for a sumptuous lunch at DoubleTree by Hilton Hotel. Be spoilt for choices as you enjoy a melting pot of Malaysian cuisine in the all-day dining restaurant - Makan Kitchen (or similar).<br />\n<br />\nAfter lunch, get ready to experience the many cultural facets of Malaysian life in the Malay Cultural Village. Sway and move to a traditional Malay cultural dance interpreted with modern music. Try your hand at Teh Tarik - pulled tea or bring home your own Batik painting at the Batik Printing Workshop.<br />\n<br />\nThis day trip will certainly be one of your delightful experiences of Asia.",
