    createdOn: "Thu Feb 04 2021 20:38:49 GMT+0000 (Coordinated Universal Time)",
    currency: "SGD",
    description:
      "Cable Car Experience Faber Peak Singapore and Sentosa on the Cable CCar Sky Network! Enjoy not one but TWO cable car lines that connect TWO buzzing destinations – Sentosa and Faber Peak Singapore.<br />\n<br />\n<strong>Mount Faber Line</strong> - Soar high above the two destinations through the sky on the most scenic highway in Singapore for priceless views. Fly high above the hill from Faber Peak Singapore, through a skyscraper and cross the harbour on the Mount Faber Line before landing in Sentosa Island.<br />\n<br />\n<strong>Sentosa Line</strong> - Journey over the jungle, sand and sea on the Sentosa Line which will take you to dozens of attractions on Sentosa. Choose your stop at the Merlion station, Imbiah Lookout station and Siloso Point station to enjoy the sandy beaches, Madame Tussauds, Mega Adventure Park, Skyline Luge Sentosa, Universal Studios Singapore, S.E.A. Aquarium and more!<br />\n<br />\n<strong>Good Old Days</strong> - There is nothing quite as familiar and comforting as the taste of wok-hei in Beef Hor Fun, the fragrance of Nasi Briyani and the appetising sight of you-tiao tossed in thick Rojak sauce. Located conveniently at Sentosa's Beach Station, this family-friendly Halal restaurant serves up a wide variety of tantalizing local favourites such as laksa, chicken rice and many more! So come and experience the Good Old Days of Singapore with our delicious local cuisine!<br />\n<br />\n<strong>ArboraAn</strong> - architectural delight, the shethered alfresco dingin area features elegant hiba wood arcs and adorned with a unique centrepiece.  Menu* - Hainanese Chicken Rice, Wok Fried Chili Crab meat, Crispy Prawn Wanton, Karopok, Bandong drink, Tauhu Goreng with peanut sauce.  <br />\n<br />\n<strong>Lunch</strong><br />\nArbora<br />\nBetween 12pm-2:30pm, daily (last seating at 2pm)<br />\n- To get to the restaurant, board the cable car from HarbourFront Station or Imbiah Lookout Station and disembark at Mount Faber Station.<br />\n<br />\n<strong>Dinner</strong><br />\nGood Old Days<br />\nFrom 5:30pm, daily (last seating at 6.30pm)<br />\n- To get to the restaurant, take the Sentosa Express from Vivo City, Lobby L, Level 3 and get disembark at Beach Station. You will spot Good Old Days restaurant as you leave the station.<br />\n<br />\n<strong>Important Information - There may be restrictions</strong><br />\nDiners who arrive after 6.30pm will have their dinner duration shorten to 1 round instead of 2 rounds. <br />\nThe entire Dining experience last about 1 hour. <br />\n<br />\n* Menus are subject to change without prior notice and based on availability.",
